    "shownotes": "This show was a private party for family and friends at Trey&#39;s dad&#39;s house. The gig consisted of the band set up in the living room playing jazz. Fish played mostly with brushes. This show featured the first known Phish performances of Autumn Leaves, My Favorite Things, On Green Dolphin Street, So What, All Of Me, and Basin Street Blues. Four unknown jazz standards were also performed. Page&#39;s dad, Jack McConnell, sat in with the band on vocals for All Of Me (a Sinatra song covered by Willie Nelson)&nbsp;and Basin Street Blues (a song originally recorded by Louis Armstrong but popularized by Willie Nelson). Fish played a trombone solo during I Didn&#39;t Know. Page&#39;s parents, the band members&#39; siblings, Andrew Fischbeck, and others were in attendance. Between sets, Trey explained his thesis &quot;The Man Who Stepped into Yesterday&quot;, commonly known as &rdquo;Gamehendge&rdquo; (without any musical accompaniment), to the McConnells and others while sitting around talking. The source of this setlist and show notes is phish.com.",
