    "venue": "Club Bene",
    "shownotes": "This show was Phish&#39;s first public gig in New Jersey and featured many references to the state. Trey started the show by saying he was born and raised in New Jersey. Before Uncle Pen, Trey said that this was sort of a dream come true for him and Page, who grew up in New Jersey, adding it was the first time they&#39;d ever played in the state. &nbsp;Trey said &quot;we&#39;ll do a little song here that brings us back to our New Jersey roots here... it&#39;s an old Bill Monroe song.&quot; Mike added that it was &quot;a song about Pendleton Vandiver, Bill Monroe&#39;s uncle. It&#39;s true. He&#39;s dead.&quot; Stash was played by request for &quot;Big Phil&quot; Muller, and was preceded by Fish&nbsp;playing the <em>Charlie Chan</em> signal. Fish&nbsp;said &quot;he wrote it,&quot; Trey said &quot;probably because I wrote it,&quot; and Mike added &quot;I think it sucks. Essentially.&quot; Regarding Stash, Trey said &quot;I collaborated on this song writing the music end of it and the lyrics were written by another native New Jerseyian, Tom Marshall, who isn&#39;t here tonight, unfortunately, because he&#39;s gotta be at work tomorrow programming computers.&quot; Fish&nbsp;added &quot;for his dad&quot; and Trey responded &quot;My dad, he works for my dad. Keeping it all in the family here.&quot; Stash and La Grange contained Buried Alive teases. Prior to Landlady, Trey said they were going to play it in honor of their first gig in New Jersey. Mike introduced Destiny Unbound as a song he wrote about his Uncle Pendleton Vandiver. Prior to Buried Alive, Trey asked for a show of hands from the sparse crowd as to how many people in the room were actually from New Jersey and said &quot;we&#39;re going to play a song that we wrote that we think captures the spirit of New Jersey,&quot; calling it &quot;New Jersey And You, Perfect Together,&quot; which is the state&#39;s tourism slogan (a joke he later referenced in Golgi and Contact). Trey encouraged the crowd to &quot;sing along when the chorus comes, just like it&#39;s a big commercial, because we&#39;ll be filming this for the next New Jersey commercial.&quot; During I Didn&#39;t Know, Trey introduced Fish&nbsp;as &quot;Zero Man&quot; and the song&#39;s lyrics were changed to Pardon Me &quot;Zero Man.&quot; Before Contact, Trey introduced his dog Marley as &quot;the 5th member of the band who doesn&#39;t usually get as much recognition... and we&#39;re going to play Marley&#39;s favorite song -- at this moment in time.&quot;",
