    "shownotes": "This show featured some great stage banter. Brother was dedicated to &ldquo;the guy who offered us $10,000 to play a different song.&rdquo; In the HYHU intro, Fish&nbsp;said &ldquo;I hate this fucking song,&rdquo; that the only reason the band plays the song is because he hates it and added &ldquo;All I have do in this band is say I hate something, and it&rsquo;ll be done forever.&rdquo; Trey told the crowd that HYHU is the Henrietta theme precisely because Fish hates it. &ldquo;It used to be &lsquo;La Bamba,&rsquo;&rdquo; he noted, prompting Mike to play a bit of La Bamba. The HYHU outro featured Fish on trombone and later telling the crowd &quot;you paid for this, this is what you bought.&quot; Trey said &quot;If you only knew what a nightmare that was for poor Fish, having to listen to that song&quot; and Fish responded with &ldquo;they just do it out of HATE.&rdquo; Trey asked who could tell him who wrote that song, and a fan answered correctly. Trey said the fan won the $10,000 the other guy was going to give them to a play a song and Page said the fan won a date with Fish, with Trey adding &quot;and you can guarantee that he&#39;ll be late.&quot; After Golgi, Trey thanked the crowd, saying &quot;we&#39;ll be right back with more songs that Fish hates, more songs that we love, and more songs that people are willing to pay $10,000 to hear.&quot; Trey introduced Page as Leon before his piano solos in My Sweet One and Rocky Top. Before Fish&#39;s trombone solo in I Didn&#39;t Know, Trey mentioned the last time they played in the area (see 4/11/91), they made Fish get up and tell a joke (The Prison Joke) that was &quot;absolutely the stupidest joke ever&quot; and that he (Trey) wasn&#39;t going tell the punchline. Trey went on to explain that most people around here thought Fish was a pretty bad joke teller and he wanted to give him a chance to redeem himself.&nbsp; Fish&#39;s joke was &quot;Why did the Siamese twins go to England? To let the other one drive for a while.&quot; Page also teased HYHU while Trey talked. Adeline was sung from the balcony without microphones to open the encore. Possum contained two <em>Charlie Chan</em> signals as well as Simpsons and Random Laugh signals in its intro and subsequently contained Rock On (David Essex) teases.",
