    "location": "Portsmouth, NH, USA",
    "venue": "The Music Hall",
    "shownotes": "<p>Many debuts were played, including Maze, My Friend, Mound, NICU, and Sleeping Monkey. This show also marked the first performance of the &ldquo;new&rdquo; revised Rift (the last &ldquo;old&rdquo; Rift was May 19, 1990, or 200 shows previous) and presented the formal introduction of the Secret Language Instructions. With the band playing Bowie in the background, Trey introduced the <em>Charlie Chan, </em>Simpsons, Me and My Arrow (Asshole in the Front Row), It Don&#39;t Mean a Thing if it Ain&#39;t Got That Swing, Random Note, All Fall Down, and Turn Turn Turn signals. Mike also teased How High the Moon during the Instructions. Trey referred to NICU as &ldquo;In an Intensive Care Unit,&rdquo; though that title was later changed, and referred to My Friend as &ldquo;Knife.&rdquo; Bowie contained a Milestones and&nbsp;<em>Jeopardy! </em>teases from Page and a Will the Circle Be Unbroken? signal, &nbsp;two Get Back signals,&nbsp;<em>Star Trek</em>, Aw Fuck!, Up Up and Away, Tritone Down, and Me and My Arrow signals, two Complete Stop signals, and It Don&#39;t Mean a Thing if it Ain&#39;t Got That Swing and Simpsons signals. Possum included Simpsons, Turn Turn Turn, Aw Fuck!, and All Fall Down signals.</p>\r\n",
    "phishnet_venueid": 77,
    "phishnet_tourid": 11,
    "tourname": "1992 Spring Tour",
