    "location": "Portsmouth, NH, USA",
    "venue": "The Music Hall",
    "shownotes": "<p>This show included the debuts of The Horse, Silent in the Morning, and Weigh, as well as the Phish debuts of My Mind&#39;s Got a Mind of its Own and Cracklin&rsquo; Rosie (and, along with it, the &ldquo;B&rdquo; and &ldquo;Ah&rdquo; cymbals). Cold As Ice also made its Phish debut as the new &ldquo;Henrietta&rdquo; theme. Trey teased the <em>Star Trek</em> theme before Brother and Long Train Runnin&#39; in Maze. Runaway Jim contained a Simpsons signal. Antelope contained.two Will the Circle Be Unbroken? signals and&nbsp;All Fall Down, Random Note, Aw Fuck!, Oom Pa Pa, Turn Turn Turn, Get Back, and Simpsons signals. Mike teased Paul and Silas in My Sweet One. Tweezer contained a Get Back tease from Page and an It Don&#39;t Mean A Thing if it Ain&#39;t Got That Swing signal. Page teased HYHU after the second Cold As Ice. Sweet Adeline was performed without microphones. Golgi ended with a&nbsp;Simpsons signal.</p>\r\n",
    "phishnet_venueid": 77,
    "phishnet_tourid": 11,
    "tourname": "1992 Spring Tour",
    "tour_year": "1992 Spring",
    "artistlink": "https://phish.net/setlists/phish"
