    "shownotes": "<p>Trey teased Buried Alive in Stash. I Didn&#39;t Know featured Fish on Bag-Vac and was dedicated to Nectar, who was in attendance. Trey teased Lazy in Llama,&nbsp;Long Tall Glasses in Tweezer, and Long Train Runnin&#39; in It&#39;s Ice. Bowie&rsquo;s intro contained teases of the last eight songs played in the show in reverse order: Uncle Pen, Squirming Coil, Bouncing Around The Room, It&#39;s Ice, Eliza, Tweezer, Golgi, and YEM. Sweet Adeline was performed without microphones.</p>\r\n",
