    "location": "Providence, RI, USA",
    "venue": "Campus Club",
    "shownotes": "<p>During the pause in Divided Sky, some fans, mocking Trey&rsquo;s comment two nights earlier, shouted out &ldquo;POSSUM!&rdquo; Trey teased We&#39;re Off to See the Wizard&nbsp;at the end of Fluffhead and in the Antelope intro and Somewhere Over the Rainbow both before and during Wilson. Antelope contained Simpsons signals in the intro and at the end of the song as well as a Groove is in the Heart tease from Mike and an Up Up and Away signal before BBFCFM. BBFCFM subsequently contained Hawaii (The Beach Boys) quotes, a Lullaby of Birdland tease, two Get Back signals, and I Let a Song Go Out of My Heart and Complete Stop signals. The second Antelope included BBFCFM lyrics from Mike. The BBFCFM sandwich is often referred to as the &ldquo;Big Black Furry Antelope.&rdquo;&nbsp;Page teased Misty before Wilson. The Secret Language Instructions featured the introductions of the Simpsons, All Fall Down, Turn Turn Turn, and Random Note signals and were preceded by an All Fall Down signal&nbsp;in Possum and Simpsons and Turn Turn Turn signals as well as a Lazy tease from Trey upon the return to Possum. Mike used an accordion on&nbsp;stage for the first known time during Contact. Trey also teased Lazy in Fire.</p>\r\n",
