    "shownotes": "<p>At the beginning of Brother, Trey said &quot;this is the alligator moat up here, so make sure you don&#39;t fall into it.&quot; and later the song&#39;s lyrics to reference the &quot;alligator pit.&quot; Antelope contained a Jean Pierre tease from Trey. Fish&nbsp;was on trombone for parts of Antelope (which also included a Simpsons signal). Trey teased Roundabout before Mike&rsquo;s Song and uttered the line, &ldquo;Help me... I&rsquo;m melting and I can&rsquo;t solidify!&rdquo; Weekapaug contained Long Tall Glasses vocals, Oom Pa Pa and Random Note signals, and a brief On Broadway tease from Trey. Sanity&#39;s intro featured various nicknames of the band and crew being shouted, while the end contained a vocal jam with more names being called out. Fish used the Bag-Vac during Terrapin. The Secret Language Instructions featured introductions of the Simpsons, Random Note, Turn Turn Turn, and All Fall Down Signals with Bowie being played in the background and included a Can&#39;t You Hear Me Knocking tease from Trey. Possum subsequently contained two Simpsons signals and an All Fall Down signal.</p>\r\n",
