    "shownotes": "<p>Foam contained an All Things Reconsidered tease. Bowie included Simpsons and Oom Pa Pa signals. The second set was preceded by birthday wishes for a fan named &quot;Amy&quot; and a remark that Buried Alive was inspired by Jimmy Herring. Possum included a Random Note and two Aw Fuck! signals and a Long Tall Glasses tease from Trey. Harpua was set in the &ldquo;teeming jungles of Brazil&rdquo; and included a special Guest by Marley as &ldquo;a vicious, flesh eating animal.&rdquo; There were theme from <em>Brazil </em>teases, a brief full-band Fire tease, high-pitched &ldquo;Brazil&rdquo; squawks from Fish, and a preview of the Clifford Ball motto (four years early) as Trey introduced Page as &ldquo;a beacon of light in the world of flight.&rdquo;&nbsp; The Aquarium Rescue Unit was the opening act.</p>\r\n",
