    "shownotes": "<p>This show featured the Phish debut of Lullaby of Birdland. Trey teased Amazing Grace before Runaway Jim. The Secret Language Instructions featured the introductions of the Simpsons, Random Note, Turn Turn Turn, and All Fall Down signals. David Bowie subsequently contained a Simpsons signal. The second set was performed <em>a cappella</em>&nbsp;and without microphones due to a small flood in the theatre. Authorities refused to allow the band to plug in their instruments, including the Bag-Vac. I Didn&#39;t Know featured Fish&nbsp;on trombone.</p>\r\n",
