    "shownotes": "<p>Page teased Call to the Post in Foam. David Bowie featured teases of the old AC/DC Bag intro and&nbsp;&#39;A&#39; Train and Simpsons, Oom Pa Pa, and Random Laugh signals in the intro. Smells Like Teen Spirit was teased before Llama and again during Mike&#39;s Song. Possum included Aw Fuck! and Random Note signals, Good Times Bad Times teases from Mike, and a&nbsp;We&#39;re Off to See the Wizard&nbsp;tease from Trey.&nbsp;Memories was performed without microphones.</p>\r\n",
