    "venue": "Variety Arts Center",
    "shownotes": "<p>Uncle Pen was played, according to Trey, &ldquo;with all due respect to Bill Monroe.&rdquo; It was also explained at this show that All Things Reconsidered is a variation on National Public Radio&rsquo;s <em>All Things Considered</em>. YEM included Groove Is in the Heart and Sunshine of Your Love teases and the vocal jam centered on a &ldquo;rolling&rdquo; theme, including the quote &ldquo;Rolling on the River&rdquo; from Proud Mary. YEM also included quotes from the theme to <em>Rawhide</em>. My Sweet One was announced by Trey as being written by the &ldquo;third greatest songwriter of all time&rdquo; while Fish&nbsp;took a bow of recognition. Memories and Sweet Adeline were performed without microphones. Widespread Panic opened.</p>\r\n",
