    "venue": "Anaconda Theatre",
    "shownotes": "<p>Possum included Random Laugh, Simpsons, Oom Pa Pa, and All Fall Down signals. Mockingbird contained Harpua teases from Mike. This version of Icculus (the first since April 6, 1991, or 118 shows) was, perhaps, the shortest version ever as it did not contain the usual build-up and screaming. Icculus was subsequently teased in the second Mockingbird. Antelope contained a We&#39;re Off to See the Wizard&nbsp;tease from Trey. Terrapin included band and crew introductions from Fish. Carolina through Sweet Adeline were performed without microphones. Widespread Panic opened.</p>\r\n",
