    "location": "San Francisco, CA, USA",
    "venue": "Warfield Theatre",
    "shownotes": "<p>Trey teased Johnny B. Goode in Reba. Bowie included All Fall Down, Random Laugh, Simpsons, and Oom Pa Pa signals, as well as the debut performance of Catapult interwoven with Bowie&rsquo;s closing segment. The curtain rose at the start of the second set to reveal Steve McConnell sitting in a large bathtub on stage. As the band played Brother, band friends and family (including Susan Gutkowski, Chip Hooper, and Mike&#39;s brother David) and crew members danced across the stage and jumped into the tub with him. The band gave the tub away at the end of the show. Trey teased Rhythm-A-Ning in YEM. Widespread Panic opened.</p>\r\n",
