    "location": "Palo Alto, CA, USA",
    "venue": "Wilbur Field, Stanford University",
    "shownotes": "<p>This was a free outdoor show at Stanford. Possum included a Simpsons signal and Antelope included Fr&egrave;re Jacques teases. Page teased Entrance of the Gladiators in Llama. Avenu Malkenu included a &ldquo;Happy Passover&rdquo; bass solo from Mike. Harry Hood contained a Linus and Lucy jam; this theme was briefly reprised at the beginning of Contact. The encore featured guest Cameron McKinney on ukulele (unmiced). McKinney, seven years old at the time, also had the honor of counting off BBFCFM. It should be noted that the infamous &ldquo;squirt gun breaks&rdquo; during this show are in reference to a security guard (named Gary Herman) cooling off the audience with a Super Soaker, and not the band shooting each other. Manteca was played for the first time since March 16, 1991 (132 shows). Monitor engineer Pete Schall cracked his head open when he ran into a pole playing Band vs. Crew Football at this show, later referenced nine years later as &quot;Pete threw a bomb and he rang the pole&quot; in Trey&#39;s composition Push On &#39;Til The Day.</p>\r\n",
