    "shownotes": "<p>Buried Alive, Stash, and possibly other parts of the first set included Cameron McKinney sitting in on &ldquo;rhythm guitar (inaudible ukelele).&quot; Trey introduced a freshly clean-shaven Fish&nbsp;before his trombone solo during I Didn&#39;t Know, saying &quot;ladies and gentlemen, recovering from a horrible facial accident, would you please welcome Tommy Dorsey.&quot;&nbsp; The end of Weekapaug included a vocal jam. Trey dedicated his solo in Lawn Boy to Amy Skelton. Lively Up Yourself was teased in the Cold as Ice intro and outro and before Brain itself. Brain subsequently included an All Fall Down signal in the middle of Fish&#39;s vacuum solo.</p>\r\n",
