    "shownotes": "<p>Trey teased Johnny B. Goode in Melt. Possum contained Simpsons, Will the Circle Be Unbroken?,&nbsp;Get Back, Oom Pa Pa, All Fall Down, Aw Fuck!, and Me and My Arrow signals, as well as strong Dave&rsquo;s Energy Guide teases. Dinner and a Movie was preceded by a Colour My World (Chicago) tease and quote. Trey used an interesting voice effect during the Mockingbird narration as he spoke of the evil King Wilson. Mike&#39;s included a Hold Your Head Up jam.&nbsp;Hydrogen and Weigh were announced as written by baseball Hall-of-Famer Carl Yastrzemski. Trey called Mike &quot;Carl&quot; prior to his Weigh bass solo. Weekapaug contained a Happy Birthday tease and dedication from Trey, as well as a Linus and Lucy tease from Mike. This only known Phish performance of Lively Up Yourself featured Trey on drums, Fish&nbsp;on bass, and Mike on guitar and his only known performance on vacuum. The Cold as Ice outro was followed by a brief vocal jam about the band&#39;s comments on their performance of Lively Up Yourself. Sanity contained Yastrzemski and Carl mentions from Mike and Trey respectively. Cavern was introduced by Mike as The Prison Joke.</p>\r\n",
