    "shownotes": "<p>The Possum intro contained a full band Yield Not to Temptation tease and Simpsons, Aw Fuck!, Oom Pa Pa, and All Fall Down signals. Possum also contained Dixie, Rhapsody in Blue, and Lazy teases as well as a Simpsons signal at the end. Landlady was preceded by a Random Laugh signal. Lizards was played for &quot;Liz.&quot; Fee&#39;s lyrics were changed to &quot;have a cup of espresso.&quot;&nbsp;Fish&nbsp;was in the process of introducing Cracklin&#39; Rosie as being by one of his favorite composers when feedback caused him to say &quot;Jesus Christ,&quot; leading to some amusing banter.</p>\r\n",
