    "venue": "Campus Rec Center",
    "shownotes": "<p>Prior to the start of the first set, Mike teased the &quot;I&#39;m Stuck on Band-Aid&quot; jingle. Page dedicated Tela to &quot;Amy&quot; on her birthday. Magilla contained an Entrance of the Gladiators tease from Trey. Antelope contained three Aw Fuck! signals and a brief Tweezer Reprise tease by Mike. Trey teased Oye Como Va and Lazy in Maze. Mike teased Wedding March at the start of Bathtub Gin. Trey teased Jean Pierre in YEM. The YEM vocal jam was based on the instrumental theme to the movie <em>Chariots of Fire</em>. During Fish&#39;s band and crew introductions in Terrapin, Chris Kuroda was introduced as Tommy Lasorda. Memories and Adeline were performed without microphones.</p>\r\n",
