    "shownotes": "<p>Both Mockingbird and Stash referenced the Los Angeles riots that ensued after the Rodney King verdict was announced. During Icculus, Trey extolled the virtues of the Helping Friendly Book and remarked jokingly that The Aquarium Rescue Unit &ldquo;used to be a feeble bluegrass band until they read this great book!&rdquo; Glide was a birthday dedication. Coil included a DEG tease.&nbsp;Bowie included Will the Circle Be Unbroken?, Get Back,&nbsp;Aw Fuck!, All Fall Down, Up Up and Away, Random Laugh, and Oom Pa Pa signals as well as the return of the Band/Crew Football Theme Song (first since April 16, 1991, or 125 shows). Bowie also included Miss Gulch / Witch&#39;s theme teases. Mike&#39;s Song and Timber (Jerry) were teased before Tela. YEM included a Don&rsquo;t Get Me Wrong tease. BBFCFM featured some zany on-stage antics that found Trey on top of his stack and Mike singing from down on the floor. The Aquarium Rescue Unit was the opening act.</p>\r\n",
