    "shownotes": "This show featured all four members of Phish. Trey joined in for Elvin Jones&nbsp;and Page joined for a piano jam leading into Big Chief.&nbsp;Mike entered during the ensuing jam and then Fish followed for Sippin Pippa&nbsp;and Don&rsquo;t Let It Stop Ya.",
