    "link": "https://phish.net/setlists/phish-october-30-1992-boston-garden-boston-ma-usa.html",
    "location": "Boston, MA, USA",
    "venue": "Boston Garden",
    "shownotes": "This show was a New Music concert sponsored by WBCN in Boston and included The Levelers, Material Issue, Michael Penn, The Spin Doctors, and a comedy troupe that was booed off stage before their time expired as the impatient crowd clamored for Phish. After Cavern, Trey said that it was his childhood dream to play for the Boston Bruins and this (performing at the Boston Garden) was as close as he would ever get. YEM was preceded by a Somewhere over the Rainbow tease by Trey and&nbsp;a Simpsons signal and included a Jean Pierre tease from Trey.",
