    "link": "https://phish.net/setlists/phish-november-21-1992-pritchard-gym-sb-sports-complex-suny-stony-brook-stony-brook-ny-usa.html",
    "location": "Stony Brook, NY, USA",
    "venue": "Pritchard Gym, SB Sports Complex, SUNY Stony Brook",
    "shownotes": "<p>Possum contained Simpsons and All Fall Down signals and a Fire (Ohio Players) tease from Trey. Carolina was performed without microphones. During the pause in Guelah, Trey introduced Amy Skelton as &ldquo;the newest member of the Phish crew&rdquo; and plugged the new J. Willis Pratt tape that Fish had produced, as well as the Greenpeace table. This show featured the debut of Buffalo Bill, which included a washboard solo from Fish. Before Buffalo Bill, Trey and Page offered an explanation of the Big Ball Jam.</p>\r\n",
