    "venue": "Matthews Arena, Northeastern University",
    "shownotes": "This show was broadcast live (and rebroadcast in its entirety the following day) on WBCN radio. In typical Phish fashion, to make the most of this opportunity, flyers were handed out to fans walking into the show that stated that the band had come up with a bunch of new &#39;language&#39; signals designed to confuse the average radio listener. The signals would be written on signs and held up by Trey at various times throughout the night. The&nbsp;handout explained each signal. Wilson included a Simpsons signal, I Didn&#39;t Know contained a Yay/Boo signal, Antelope included a Random Note signal, the Mockingbird narration included a Mass Hysteria signal, and Harpua included a Lip-Flop signal. Wilson and the end of Divided Sky contained <em>Jeopardy!</em> teases from Page and Antelope contained an Auld Lang Syne tease from Trey. Brad Sands was hoisted above the crowd as The Famous Mockingbird (in a chicken&nbsp;costume) during the Mockingbird narration (about being taken underwater and turned into stone). The narration also contained&nbsp;teases of &quot;Charge!&quot; and the theme to <em>Star Trek</em> from Page. This was the first time that Mike&rsquo;s and Weekapaug were played without Hydrogen in the middle as the band treated the audience to a fantastic New Year&rsquo;s transition. The Mike&rsquo;s combo included Trey counting down to the New Year and telling the crowd that they better make the last minute of the year a good one. Kung was played for the first time since November 2, 1989 (414&nbsp;shows). This show featured the Phish debut (and only appearance) of Diamond Girl, which featured The Dude of Life on vocals. Dressed as an old man, The Dude entered and exited the stage pushing a lawnmower. Carolina was performed without amplification.",
