    "venue": "Mid-Hudson Civic Center",
    "shownotes": "<p>The break in Guelah featured an Oom Pa Pa signal and the Esther intro included Simpsons and Random Note signals. Trey teased Jean Pierre and Take the&nbsp;&#39;A&#39; in Antelope.&nbsp;The beginning of My Friend featured Trey on acoustic guitar. During YEM, Phish&nbsp;sang &quot;Water your team in a beehive I&#39;m a-sent you&quot; alternate lyrics. Harry Hood was played in response to chanting by a group in front. The Harpua narration included a Black or White jam as Jimmy was watching the halftime show of the Super Bowl and saw Michael Jackson. Poster then killed Harpua and then had a heart attack. During the show, Trey remarked that Fish&nbsp;is always late for the bus in the morning and that they have a $1,000 bet on whether he can be on time for the entire tour.</p>\r\n",
