    "shownotes": "After Stash, Page made an announcement on behalf of the building manager that &ldquo;for your own safety the aisles must be cleared.&rdquo; Trey then noted that this was the band&rsquo;s first appearance in Delaware, and Trey and Page dedicated Lawn Boy to the state of Delaware. Wilson contained Simpsons, Oom Pa Pa, and Random Note signals. The YEM vocal jam contained a Lion Sleeps Tonight theme. Fish introduced Lengthwise as &ldquo;a very nice song, a sad lament, where I am left out naked on the plank (I can get arrested for that these days)&rdquo; and he directed a crowd sing-along accompaniment to his vacuum solo.",
