    "shownotes": "<p>The Esther intro contained a Random Note signal.&nbsp;I Didn&#39;t Know featured Fish&nbsp;on trombone. Antelope contained All Fall Down and Oom Pa Pa signals and a Yakety Sax tease from Mike. Page and Trey briefly played Love You as Fish announced he was going to perform it before changing his mind to&nbsp;Bike. At the request of taper Matt Heller, Fish&nbsp;ran around the audience and the balcony with his vacuum during Bike. Page teased Purple Haze in Bike. Trey sang some of the verses of Fee through a megaphone. Contact was dedicated to Charlie, the bus driver.</p>\r\n",
