    "venue": "Benton Convention Center",
    "shownotes": "<p>Possum contained a Get Up (I Feel Like Being a) Sex Machine tease from Trey. The Bowie intro included Simpsons, Random Note, and Oom Pa Pa signals. Trey later teased Manteca and Johnny B Goode in Bowie. The beginning of My Friend featured Trey on acoustic guitar. BBJ contained &quot;Charge!&quot; and Call to the Post teases from Page. YEM contained a <em>Mission: Impossible</em> theme tease from Page, a Black and White (David I. Arkin and Earl Robinson) tease from Mike,&nbsp;and Sunshine of Your Love teases. Verses of Sunshine of Your Love were subsequently quoted in the YEM vocal jam. Lengthwise was performed with vacuum accompaniment.</p>\r\n",
