    "location": "Knoxville, TN, USA",
    "venue": "Electric Ballroom",
    "shownotes": "<p>Lawn Boy was played per Page&#39;s cousin Keith&#39;s request. Antelope included an I&#39;m a Man tease from Page,&nbsp;an All Fall Down signal, and a Yakety Sax tease from Mike. Mike&#39;s Song contained a brief tease from Page of In the Hall of the Mountain King and multiple Another One Bites the Dust teases. The soundboard shorted out during Mound. Rocky Top featured Fish&nbsp;on trombone, was performed acoustic, and along with Amazing Grace through Sweet Adeline, without microphones. The band engaged in a rubber band fight between Sweet Adeline and Rocky Top.</p>\r\n",
