    "location": "Atlanta, GA, USA",
    "venue": "Roxy Theatre",
    "shownotes": "<p>Trey sang the verses of Fee through a megaphone. The Mockingbird narration recalled the flood from Phish&rsquo;s last Atlanta performance, on March 28, 1992. The beginning of My Friend featured Trey on acoustic guitar. This show was performed on Fish&rsquo;s birthday, which Trey made reference to during the Bowie intro. The Phish debut of Moby Dick featured Fish&nbsp;soloing on both drums and vacuum. The subsequent Bowie intro&#39;s continuation contained a Simpsons signal and Happy Trails and&nbsp;Jingle Jangle Jingle teases. Bowie later contained Moby Dick teases. Happy Birthday was teased in Bowie and Ya Mar and performed by Page during Love You. Mockingbird and Big Ball Jam contained &quot;Charge!&quot; teases. Lawn Boy&nbsp;was dedicated to Page&rsquo;s parents. Funky Bitch through Llama&nbsp;featured Jimmy Herring sitting in on guitar. My Sweet One was unfinished. After the first HYHU, Trey tried unsuccessfully to convince Colonel Bruce Hampton to come out and jam on horns. Love You featured Fish&nbsp;on guitar and vacuum, as well as the delivery of a birthday cake. Trey also presented Fish&nbsp;with a clock necklace a la Flavor Flav of Public Enemy, so that Fish would never again be late for the bus. Amazing Grace was performed without microphones and was also dedicated to Page&rsquo;s parents with Page saying it was one of his father&#39;s favorite songs. Page&#39;s father gave a standing ovation after the song&#39;s finish. AC/DC Bag was played for &ldquo;Hack&rsquo;s&rdquo; 21st birthday, as he had evidently requested it at a party the night before. This show was released as part of the <em>Phish At The Roxy</em> box set.</p>\r\n",
