    "location": "Atlanta, GA, USA",
    "venue": "Roxy Theatre",
    "shownotes": "<p>The Horse featured Trey on acoustic guitar. This long version of Wilson included a Simpsons signal and, towards the end, a freakish jam that included an Iron Man tease from Mike. Reba included a tease of the theme from <em>Woody Woodpecker</em>. The first Tweezer had Straight Out the Sewer quotes from Trey and a&nbsp;Low Rider jam. Glide subsequently included Tweezer teases. Mike&rsquo;s Song featured minor lyric changes, three different Tweezer teases, two different Wilson teases, and other teases of Reba, Lizards, and Stash. During Hydrogen before the Vibration of Life, Mike teased Entrance of the Gladiators. After Kung, Mike quoted NO2. The Rock and Roll All Nite jam was for fan Jay von Lehe, dressed as Kiss&rsquo;s Gene Simmons, who the band brought on stage to sing the song&rsquo;s chorus. Terrapin featured band intros and lots of chatter from Fish, prompting a hurry-up HYHU tease from Page. Fish also performed a lengthy vacuum solo during this tune. The HYHU outro segued into Hood as Fish and Trey switched places. Neither Have Mercy (first since Halloween, 1986, or 669&nbsp;shows) nor MMGAMOIO were played in their entirety. Walk Away was played for the first time since November 2, 1991 (159 shows).&nbsp;This show was released as part of the&nbsp;<em>Phish At The Roxy</em>&nbsp;box set.</p>\r\n",
