    "shownotes": "<p>Prior to starting Suzy, the band sung the first line <em>a cappella</em> in a different manner than the rest of the song. Suzy also included a Tweezer tease. Esther began with Page modifying the intro (including a brief reggae attempt) and included a Simpsons signal. Antelope included <em>Woody Woodpecker</em>&nbsp;theme and Gimme Some Lovin&#39; teases and a Random Note signal. Good Times Bad Times, which was performed bluegrass-style, through Pig in a Pen (a Phish debut) featured the &ldquo;Reverend&rdquo; Jeff Mosier on banjo. Manteca was played for the first time since April 18, 1992 (107 shows).&nbsp;This show was released as part of the&nbsp;<em>Phish At The Roxy</em>&nbsp;box set.</p>\r\n",
