    "shownotes": "<p>Guelah Papyrus included a Simpsons signal before the Secret Language Instructions. The Instructions included a Call to the Post tease from Page and introductions of the Simpsons and Random Note signals. Trey sang the verses of Fee through a megaphone. I Didn&#39;t Know featured Fish&nbsp;on trombone. The Bowie intro contained Maze teases from Mike. The YEM vocal jam was based on How Many More Times (Led Zeppelin) and later contained Frankenstein and <em>Jeopardy! </em>teases. Trey teased the theme from <em>Woody Woodpecker</em> before The Squirming Coil.</p>\r\n",
