    "venue": "Dobson Arena",
    "shownotes": "<p>Guelah contained a Simpsons signal and a Lively Up Yourself tease from Mike. Trey dedicated Stash to &quot;Mary.&quot; The ending of Fluffhead, all of The Horse, and the beginning of My Friend featured Trey on acoustic guitar. Bowie contained a Random Note signal in the intro,&nbsp;a Sailor&#39;s Hornpipe tease from Trey, and Dueling Banjos and&nbsp;<em>Jeopardy!</em>&nbsp;theme teases from Page.&nbsp;In an attempt to request AC/DC Bag at the start of the second set, roughly twenty people in front donned shopping bags on their heads with the word AC/DC written on them. My Friend contained Careful with That Axe, Eugene (Pink Floyd) quotes. YEM contained a beehive (from the alternate &quot;Water Your Team In A Beehive I&#39;m A-sent You&quot; lyrics) reference from Trey and a Low Rider tease from Page. Mike quoted You Sexy Thing in the YEM vocal jam.&nbsp;The HYHU outro contained Lengthwise teases from Mike. Danny Boy was quoted before Carolina.</p>\r\n",
