    "shownotes": "<p>Possum included Simpsons and Oom Pa Pa signals. Trey dedicated Glide to Terry (who drove the truck that got the band&#39;s equipment to every show). Magilla (last played May 8, 1992, or 114 shows) included a Stash tease. There was an Ob-La-Di, Ob-La-Da jam in the Antelope intro and a tease by Trey later in Antelope.&nbsp;Icculus was played for the first time since May 2, 1992 (119 shows). Mike teased Cheap Sunglasses in Mike&#39;s Song. Weekapaug contained a Don&#39;t Get Me Wrong jam and Don&#39;t Get Me Wrong and Ob-La-Di, Ob-La-Da teases from Trey. Sweet Adeline was performed without microphones.The soundcheck&#39;s The Wedge was a masuhup with what would later become Wolfman&#39;s Brother.</p>\r\n",
