    "shownotes": "<p>The beginning of My Friend and all of The Horse featured Trey on acoustic guitar. My Friend contained a <em>Sesame Street</em> theme tease from Trey. Llama and Stash contained&nbsp;Can&#39;t You Hear Me Knocking teases. Esther&#39;s intro contained a Random Note signal and a HYHU tease from Page. Misty Mountain Hop was teased in Stash and Weigh. Hydrogen contained Call to the Post teases from Trey. Weekapaug contained a quote by Trey of&nbsp;Is She Really Going Out with Him?. After Weigh, Trey mentioned that &quot;the Big Ball Jam was born in this very room one year ago today&quot; and wished it a happy birthday, followed by a quick tease of Happy Birthday by Page and Trey wishing happy birthday to &quot;Bob&quot; who was in the audience. Mike dedicated Mike&rsquo;s Song to himself. The band subsequently included several references to it being &ldquo;his song.&rdquo; The Phish debut of Psycho Killer was unfinished. Tela was teased after the soundcheck&#39;s &quot;Jam.&quot;</p>\r\n",
