    "shownotes": "<p>I Didn&rsquo;t Know featured Fish&nbsp;(introduced by Trey as &ldquo;Madonna&rdquo;) on washboard. Bowie included All Fall Down and Simpsons signals; Hood later contained another Simpsons signal and <em>Pink Panther</em> theme and <em>Odd Couple</em> theme teases. The segue from Lengthwise to Maze included an audience assist: the audience continued to sing the Lengthwise chorus after Fish&nbsp;finished, and the Maze high-hat intro completed the transition. YEM didn&#39;t contain a vocal jam. Harpua contained Buried Alive and&nbsp;Axel F teases. The Phish debut of She&#39;s So Cold was incomplete.&nbsp;At the end of Chalk Dust and again before AC/DC Bag, Trey made comments about Bonnie Raitt, who was also playing in town and whom he &ldquo;has a big crush on.&rdquo; Sweet Adeline was dedicated to &quot;Nina,&quot; who lost her ID and got it back from Trey on stage.</p>\r\n",
