    "venue": "Roseland Theater",
    "shownotes": "<p>The beginning of My Friend featured Trey on acoustic guitar. Antelope included I Feel the Earth Move and Barracuda teases. The prevalent rumor among audience members (aided, to some extent, by the band and crew helping spread the rumor) was that Neil Young would make a Guest. Trey teased Heart of Gold before Llama and Sugar Mountain before The Squirming Coil and in Lawn Boy. Tweezer contained Fire (Ohio Players) teases. After Big Ball Jam, the crew set up a folding chair, Trey&rsquo;s acoustic guitar, and an extra microphone on stage. Trey introduced &quot;Neil Young&quot; to the roaring crowd, then went behind the drums and began playing the Hold Your Head Up intro with Fish appearing&nbsp;instead. Some friends sitting in the front row promptly hit Fish in the face with a pie. Fish sang&nbsp;a line of After the Gold Rush (with Page assisting on piano) before launching into Terrapin. After the second Hold Your Head Up, Trey joked that Bill Clinton would be helping out on saxophone for the next song prompting Page and Fish to tease Pomp and Circumstance March No. 1. Carolina was performed without microphones.</p>\r\n",
