    "shownotes": "<p>Stash contained DEG teases from Trey. The Mockingbird narration contained teases of Those Were the Days (aka the theme from <em>All in the Family</em>) and &quot;Charge!&quot; by Page. The Bowie intro contained a Mockingbird tease and Simpsons, All Fall Down, and Oom Pa Pa signals. Caravan was played for the first time since July 23, 1991 (224 shows). Llama contained a Caravan tease from Trey and Tweezer included multiple Caravan teases. Caravan contained a Manteca tease and YEM contained several Owner of a Lonely Heart teases. Fire was dedicated to Dudley, the other guitarist in Trey&rsquo;s high school band, Space Antelope (Dudley was in attendance).</p>\r\n",
