    "venue": "State Theatre",
    "shownotes": "<p>The Horse and the beginning of My Friend featured Trey on acoustic guitar. I Didn&#39;t Know featured Fish&nbsp;on the Madonna washboard. Suzy included a Stairway to Heaven tease from Trey. My Friend contained a Killer Joe tease from Page near the end of the song. YEM contained Groove is in the Heart teases. YEM&#39;s vocal jam and My Sweet One contained&nbsp;references to &quot;Mr. Cookie Head,&quot; who was a fan out in the audience dressed in a cookie costume. Big Ball Jam contained an Auld Lang Syne tease from Trey. During the band introductions in Love You, Fish introduced Brad Sands, prompting a &quot;Charge!&quot; tease from Page, and &quot;Cookie Man&quot;, leading to a HYHU tease. New York New York was teased after Page&#39;s introduction. Fish&nbsp;quoted Iron Man in his Love You vacuum solo. Love You subsequently contained a Sound of Music tease from Page and Mike. Possum had a Simpsons signal and ended with &quot;Cookie Head Man&quot; references from Trey.</p>\r\n",
