    "shownotes": "<p>Melt contained an 1812 Overture tease from Mike and a&nbsp;Jean Pierre tease from Trey. The beginning of My Friend featured Trey on acoustic guitar. Chalk Dust contained a Simpsons signal anda Can&#39;t You Hear Me Knocking tease from Trey. The Bowie intro included a tease medley opening of songs played earlier in the set, including Lawn Boy, Chalk Dust, Uncle Pen, My Friend My Friend, Squirming Coil, Melt,&nbsp;Sparkle, and Weigh, as well as Random Note and Oom Pa Pa signals. Mike later teased Dave&#39;s Energy Guide in Bowie. Maze contained Miss You teases from Trey and Mike&rsquo;s Song included a Miss You tease and subsequent jam.&nbsp;Funky Bitch through Cavern featured Sugar Blue on harmonica. Sugar Blue also sang vocals on the Phish debuts of Help Me and Hoochie Coochie Man.</p>\r\n",
