    "venue": "IMU Ballroom, University of Iowa",
    "shownotes": "<p>The Horse featured Trey on acoustic guitar. Between Llama and Satin Doll, Trey told a story about how his great-grandfather went to the University of Iowa and his grandmother used to attend dances in the same venue and dance to the big band music of Duke Ellington. Antelope contained a Satin Doll tease from Trey and a Simpsons signal. Trey teased Fire (Ohio Players) in Tweezer. YEM contained Gumbo lyrics&nbsp;and the YEM vocal jam included New York, New York lyrics,&nbsp;a bit of&nbsp;Swing Low, Sweet Chariot, and Setting Sail lyrics from Fish. Terrapin included Mississippi Queen teases from Trey and Page and a&nbsp;brief In-A-Gadda-Da-Vida jam (with lyrics) during Fish&#39;s vacuum solo. Satin Doll was played for the first time since February 25, 1990 (417 shows) and Highway to Hell was played for the first time since November 15, 1991 (185 shows).</p>\r\n",
