    "shownotes": "<p>Possum and Mike&#39;s Song included Dave&#39;s Energy Guide teases.&nbsp;The Mockingbird narration contained a Killer Inside Me quote from Trey and Jump (Van Halen) teases from Page. Caravan included Manteca teases from Trey and Page.&nbsp;The beginning of My Friend featured Trey on acoustic guitar. Mike&#39;s Song also contained Walk This Way teases. Weekapaug ended in a Can&#39;t You Hear Me Knocking jam.</p>\r\n",
