    "venue": "American Theater",
    "shownotes": "<p>Kung segued into a Dave&#39;s Energy Guide jam before turning back into Stash, which also featured Kung quotes. The second Kung was recited while Trey, using an acoustic guitar, improvised on the intro to Horse and contained a brief Pinball Wizard jam. The second Kung and The Horse featured Trey on acoustic guitar and the intro to The Horse contained a Harry Hood tease. I Didn&#39;t Know featured Fish&nbsp;on the Madonna washboard. At the beginning of the second set, Trey&rsquo;s friend Roger Holloway got on stage and asked his girlfriend Jen to marry him. She said yes, and in response the band played AC/DC Bag (which references Roger in the lyrics), which also included Woman from Tokyo and Johnny B. Goode teases from Trey. The Spooky Jam inside of YEM included a verse sung by Page. Mike teased Spooky in the return to YEM. The YEM vocal jam included a <em>Jeopardy!</em> tease. Harpua featured teases of Dream Weaver and <em>The Jetsons</em> theme as well as vocal quotes from The End (The Doors); the narration centered on a story about people who steal your dreams at night. Trey dedicated Contact to Roger and Jen &ldquo;on the road of life.&rdquo; This show was released as part of the <em>St. Louis &#39;93</em> box set.</p>\r\n",
