    "venue": "The Macauley Theater",
    "shownotes": "<p>Before Chalk Dust, Trey chided Fish&nbsp;for being late. Melt contained an 1812 Overture tease from Mike.&nbsp;Hood included a Simpsons signal. The Horse featured Trey on acoustic guitar. Trey teased Taps in Big Ball Jam. Trey dedicated Highway to Hell to Terry, the equipment truck driver. Gumbo was played for the first time since July 25, 1991 (228 shows) and contained&nbsp;a Free Bird-style ending.</p>\r\n",
