    "venue": "Private Home",
    "shownotes": "This private party and jam session included two bass players, three guitar players, two drummers, percussion and keyboards. There was a rotation of performers throughout the night, including Mike on bass and Fish on drums, and members of local bands <a href=\"http://www.facebook.com/pages/Deep-Space-Six/108300929745?sk=app_2405167945\">Deep Space Six</a> and <a href=\"https://www.davidsolidgould.com/uncle-chunk/\">Uncle Chunk</a>. The only known song performed was the <em>Sanford and Son</em> theme. No known recording exists. Phish had performed <a href=\"http://phish.net/setlists/?phishnet_showid=1251353055\">earlier in the evening</a> at the Michigan Theatre.",
