    "venue": "Michigan Theater",
    "shownotes": "<p>My Friend started out with Trey on acoustic guitar and later included an Ob-La-Di, Ob-La-Da jam. Antelope included Random Note and Simpsons signals and a Gimme Some Lovin&#39; tease from Page. YEM included teases of the closing jam to I Wish. Sweet Adeline was performed without microphones. BBJ featured Trey on drums and Fish&nbsp;on vacuum. BBFCFM included some humorous additional lyrics from Mike, who echoed a fan&rsquo;s cry that he could &ldquo;smell [himself] running.&rdquo;&nbsp; Trey also forgot he was supposed to start part of the song and there was a long, silent pause on stage (which included a Misty tease from Page) until he finally realized that the rest of the band was waiting for him. In the soundcheck, Page teased and quoted Substitute after I Can&#39;t Explain.</p>\r\n",
