    "location": "Ann Arbor, MI, USA",
    "venue": "Michigan Theater",
    "shownotes": "<p>Mike teased I Can&#39;t Turn You Loose in Divided Sky. During the section of I Didn&rsquo;t Know where Fish&nbsp;usually does some sort of solo, Page asked everyone who had been there the night before how they liked the encore. Trey and Mike put their microphones in the same position as they were for BBFCFM, and Page brought people on stage to give testimonials about how they felt about it. &ldquo;Special guests&rdquo; included Brad Sands. Paul Langedoc,&nbsp;and Chris Kuroda. Paul said he was thinking what a real&nbsp;hardcore punk band would really sound like and played what he thought it would sound like (a clip of Sex Pistols&#39; Holiday in the Sun).&nbsp;Trey admitted his guilt in the mishap and the song continued. Trey teased Can&#39;t You Hear Me Knocking in Tweezer. The Horse included an extended intro section and featured Trey on acoustic guitar. Possum contained Purple Haze, I Feel the Earth Move, and In Memory of Elizabeth Reed teases.&nbsp;Mike&rsquo;s Song included a melodic Low Rider jam before segueing into Ya Mar. Amazing Grace was performed without microphones.</p>\r\n",
