    "venue": "Newport Music Hall",
    "shownotes": "<p>The jam segment of this Melt is the one that appears at the end of Demand on <em>Hoist. </em>The Mockingbird Narration contained a quote of the Winkie Chant (&quot;O-Ee-Yah! Eoh-Ah!&quot;) from <em>The Wizard of Oz</em>. I Didn&#39;t Know featured Fish&nbsp;on trombone and The Horse featured Trey on acoustic guitar. Antelope contained a Divided Sky tease from Trey, an I&#39;m a Man (Spencer Davis Group) tease from Page, and&nbsp;Simpsons, Key Change, Tritone Down, and Random Note signals. Trey teased Fire (Ohio Players) in Possum. Mike&#39;s contained a brief Oye Como Va tease. Weekapaug was unfinished. Gumbo&nbsp;contained&nbsp;a Free Bird-style ending.</p>\r\n",
