    "location": "Hamilton, NY, USA",
    "venue": "Cotterell Court, Reid Athletic Center, Colgate University",
    "shownotes": "The ending of Fluffhead and the beginning of My Friend featured Trey on acoustic guitar. &nbsp;My Friend subsequently contained a Baby Elephant Walk tease from Page. Lawn Boy was dedicated multiple times by each band member to Fish&#39;s parents, who were in attendance at the show. This Weekapaug included atypical, jazz-laced jams. Lengthwise featured Mimi Fishman on vacuum and band members parading around the stage with cheerleading banners proclaiming: &ldquo;Winners PLAY HARD&rdquo; and &ldquo;WE WIN IN OUR GYM.&rdquo; There was an unusually long break before the Fire encore.",
