    "shownotes": "<p>Some of the fans cheered the mention of Qu&eacute;bec during Fee, which featured Trey singing the verses through a megaphone. Antelope included a brief jam on Pink Floyd&rsquo;s Money and a tease of Dance of the Sugar Plum Fairy by Page. Chalk Dust contained Money and Lazy (Deep Purple)&nbsp;teases from Trey. Ya Mar contained an I Can&rsquo;t Turn You Loose tease from Page and funny stage banter as Trey tried to bring &ldquo;Leo&rdquo; in too early. Page teased Gimme Some Lovin&#39; in Mound. Sanity was teased in Reba. Hydrogen included a tease of Jingle Jangle Jingle, with a bassline somewhat akin to Happy Trails. Weekapaug included the theme from <em>Bonanza</em> and Can&rsquo;t You Hear Me Knocking teases from Page and an NICU tease from Trey. Fish&nbsp;dedicated Terrapin to his friends from Burlington who made the trip to see the band. Makisupa was played for the first time since November 26, 1990 (322 shows). The beginning of My Friend featured Trey on acoustic guitar. Mike teased the Beverly Hillbillies theme in the soundcheck&#39;s Reggae Jam.</p>\r\n",
