    "venue": "Tower Theatre",
    "shownotes": "<p>Melt contained an 1812 Overture tease by Mike.&nbsp;Trey sang the verses of Fee through a megaphone. The ending of Fluffhead and the beginning of My Friend featured Trey on acoustic guitar. Mike&rsquo;s Song included a Fuckin&rsquo; Up tease. Page teased the theme from <em>Star Trek</em> in Weekapaug Groove. Carolina was performed without microphones. The soundcheck&#39;s Poor Heart was performed <em>a cappella.</em></p>\r\n",
