    "location": "Upper Darby, PA, USA",
    "venue": "Tower Theatre",
    "shownotes": "<p>The Horse featured Trey on acoustic guitar and I Didn&#39;t Know featured Fish&nbsp;on the Madonna washboard. YEM included theme from&nbsp;<em>Speed Racer</em> and Oye Como Va teases. The Lizards also included a theme from <em>Speed Racer</em> tease. Antelope included Key Change, Simpsons, Tritone Down, and Random Note signals as well as theme from <em>The Good, The Bad&nbsp;and The Ugly</em>&nbsp;and Gimme Some Lovin&#39; teases from Page. Sleeping Monkey was delayed while Trey scrambled to remember the lyrics. He remarked that it was particularly embarrassing since Tom Marshall was in the audience. After Antelope, Fish&nbsp;listened to the crowd&rsquo;s requests, including Trey&rsquo;s request of Undun, before settling on Rosie.</p>\r\n",
