    "location": "New Brunswick, NJ, USA",
    "venue": "State Theatre",
    "shownotes": "<p>Weigh included a tease by Trey of the&nbsp;theme from<em> Woody Woodpecker</em>.&nbsp;The Esther intro contained a Random Note signal. Trey teased Under Pressure in Split Open and Melt. The Mockingbird narration included the Vibration of Life and a teases of New York, New York and the theme from <em>Star Trek </em>from Page. The Possum intro contained a Mockingbird tease from Trey. Mike teased Do You Feel Like We Do prior to the second set. AC/DC Bag included&nbsp;a Jean Pierre tease from Trey. Tweezer included I Feel the Earth Move,&nbsp;Fire (Ohio Players), and Can&#39;t You Hear Me Knocking&nbsp;teases. Big Ball Jam contained a &quot;Charge!&quot; tease from Page. Love You included a Blue Monk tease from Page and a Page-led HYHU sandwiched in the middle after Fish&nbsp;rambled on with crew introductions. Memories and Amazing Grace were performed without microphones. In the soundcheck, Minuano (Six Eight) was teased at the end of Phase Dance, Will I Dance ended with a Hold Your Head Up tease from Page, and Black Or White was teased after Mustang Sally.&nbsp;This show was originally released (and is now available as an archival release)&nbsp;on Live.Phish.com with&nbsp;proceeds benefiting the Hurricane Sandy relief effort.</p>\r\n",
