    "venue": "Palace Theatre",
    "shownotes": "<p>It&#39;s Ice contained a tease of Pop Goes the Weasel from Page. Maze contained Lazy and San-Ho-Zay teases from Trey and a&nbsp;<em>Mission: Impossible</em>&nbsp;theme tease&nbsp;from Page. The beginning of My Friend featured Trey on acoustic guitar. Trey dedicated Ya Mar to Sue on her birthday. Ya Mar subsequently included I Can&#39;t Turn You Loose and Two Princes teases. YEM contained a La Marseillaise tease from Page and Yield Not to Temptation teases, did not contain a vocal jam, and was unfinished. The jam after YEM featured The Aquarium Rescue Unit, the Dude of Life, and Fish&nbsp;on vacuum. Amazing Grace was performed without microphones. The soundcheck&#39;s Funky Bitch Blues contained a Funk #49 tease.</p>\r\n",
