    "venue": "Palace Theatre",
    "shownotes": "<p>Chalk Dust Torture contained Lazy teases from Trey.&nbsp;The Horse featured Trey on acoustic guitar. Trey teased Jean Pierre in Fluffhead. Possum contained Simpsons, Key Change, and All Fall Down signals. Why You Been Gone So Long, Tennessee Waltz, I Been To Georgia On A Fast Train and That&#39;s Alright Mama were all Phish debuts. Lawn Boy, Why You Been Gone So Long, Rocky Top, both HYHUs, and Cracklin&#39; Rosie featured Dick Solberg on violin. Tennessee Waltz, I Been To Georgia On A Fast Train, and That&rsquo;s Alright Mama featured Solberg on violin and Jeff Walton on acoustic guitar. Why You Been Gone So Long also featured Walton on vocals. Page teased &quot;Charge!&quot; before Why You Neen Gone So Long and in Big Ball Jam. Tweezer included a Sweet Emotion tease and a jam on Crimes of the Mind. Mike&#39;s Song contained Cheap Sunglasses teases. Rosie was &ldquo;dedicated to Neil, who&#39;s on tour now!&rdquo; Sweet Adeline was performed without microphones.</p>\r\n",
