    "shownotes": "<p>Caravan contained a tease of Manteca. Page teased &quot;Charge!&quot; in The Lizards. I Didn&#39;t Know featured Fish&nbsp;on the Madonna washboard. Trey teased Johnny B. Goode in Run Like an Antelope. Trey sang the verses of Fee through a megaphone. YEM included <em>Mission: Impossible</em> theme and Fire (Ohio Players) teases and a Yield Not to Temptation jam. The YEM vocal jam was based on the <em>Bonanza </em>theme and also contained Under Pressure teases from Trey. Trey teased A Night in Tunisia in Harry Hood. Harpua&#39;s narration focused on the story of pro wrestler &quot;Ravishing&quot; Rick Rude and contained a tease of Crossroads, which would make its Phish debut the following day.</p>\r\n",
