    "shownotes": "<p>The soundcheck treated those who arrived early to the first-ever Guyute, which was an unfinished, raw version of the song that eventually made it to the stage fifteen months later. Pungee contained a Camel Walk quote and the Dude of Life Medley contained Trials and Tribulations, Crimes of the Mind, Lucy in the Subway, Family Picture, Ordinary Day, Dahlia, Francella, and T.V. Show quotes and closed with a Free Bird tease. The Train Medley in the soundcheck included quotes from Folsom Prison Blues, Mystery Train, One After 909, and Love in Vain. Trey and Mike teased Possum before Esther. Antelope included Heartbreaker and Brother jams. Fireworks from nearby Three Rivers Stadium coincided with Antelope and Mound. Trey sang the verses of Fee through a megaphone. Prior to Purple Rain, Fish&nbsp;found out that one of the crew members tried to play a prank on him by turning his vacuum cleaner inside out. Fish&nbsp;introduced Peter Schall and Brad Sands with Page teasing HYHU.</p>\r\n",
