    "shownotes": "<p>Paul and Silas through Rocky Top featured Gordon Stone on banjo. The show was played in a total downpour and the amphitheater was apparently not built to handle that kind of weather. Before the first set, Trey remarked that the staff was talking about canceling the show due to the danger of electrocution. &ldquo;I told &lsquo;em, &lsquo;Fuck that. Put the plug up my ass and count out Llama!&rsquo;&rdquo; said Trey. Walk Away included an Alive (Pearl Jam) tease and Possum included an All Fall Down signal in the intro and a brief Tweezer Reprise tease from Trey. Page teased Call to the Post when Gordon Stone was introduced after Possum.</p>\r\n",
