    "shownotes": "<p>The Contact opener started before the band took the stage, as they were driven to the front in golf carts and performed the song off stage. Some fans didn&rsquo;t even realize the show had started until well into Llama, as that song was begun off stage. I Didn&#39;t Know featured Fish&nbsp;on the Madonna washboard. Page teased Entrance of the Gladiators at the end of Cavern and I Feel The Earth Move in Tweezer, and the theme from <em>Speed Racer</em> in Fluffhead.&nbsp;The Horse, the ending of Tweezer and Fluffhead, and the beginning of My Friend featured Trey on acoustic guitar. The Bowie intro contained a Squirming Coil tease from Trey. The show took place in Starwood Amphitheatre&#39;s concessions area, which was roped off to accommodate 3,500 though fewer than 1,800 tickets were sold.</p>\r\n",
