    "venue": "Ritz Theatre",
    "shownotes": "<p>Brother made its first appearance since July 14, 1992 (143 shows). Other breakouts included Dog Log (dedicated to Paul, and first since May 4, 1991, or 283 shows), La Grange (first since March 17, 1991, or 310 shows) and Sparks (first since September 13, 1990, or 392 shows). Guelah Papyrus contained a Simpsons signal. Bathtub Gin contained Low Rider, Sweet Virginia, and I Feel Pretty (West Side Story) teases. Page teased Blue Monk in My Mind&#39;s Got a Mind of its Own. The jam out of Mike&rsquo;s featured Joe Rooney of the band First Born on vocals. Bike was preceded by a Moonshadow tease from Mike. There were Contact, Jean Pierre,&nbsp;When the Saints Go Marching In, Gimme Some Lovin&#39;, and Makisupa teases in Antelope, along with the lyric &ldquo;Marco Policeman-dolas&rdquo; and an All Fall Down signal. Amazing Grace was performed without microphones. This show was originally scheduled for the Cuban Club Plaza and was moved to the Ritz Theatre two weeks prior to the gig.</p>\r\n",
