    "venue": "Cincinnati Zoo Peacock Pavilion",
    "shownotes": "<p>Suzy Greenberg, Tweezer, Guelah Papyrus, and YEM included Tequila teases.&nbsp;Guelah included a Simpsons signal. YEM also contained Entrance of the Gladiators and Oye Como Va&nbsp;teases&nbsp;and the&nbsp;YEM vocal jam was to the tune of Cocaine and included some Tweezer lyrics. Slave was played for the first time since October 24, 1991 (241 shows) and contained a So What tease from Trey.</p>\r\n",
