    "venue": "Darien Lake",
    "shownotes": "<p>Stash was unfinished and included Dave&#39;s Energy Guide teases from Trey. Makisupa contained a Stash quote from Trey. Reba was performed without the whistling ending. To compensate, there was some whistling from Reba during the Maze opening. Maze contained a tease of Stairway to Heaven. The narration in Mockingbird dealt with the &ldquo;Roller Coaster of the Mind&rdquo; and contained a Paint It Black tease from Page and a Wilson tease from Trey. Cavern contained a Purple Haze tease from Trey. At the end of Cavern, Trey wished Happy Birthday to &quot;Jim&quot; and said it was Steph&#39;s birthday and said it would be funny if everybody who walked by the Greenpeace table gave her a hug. Page also teased &quot;Charge!&quot; while Trey was talking. Mike&rsquo;s Song contained an Also Sprach Zarathustra tease from Trey, a&nbsp;New York, New York tease from Page, and&nbsp;Aw Fuck! and Oom Pa Pa signals. The beginning of My Friend featured Trey on acoustic guitar. Mike teased Twinkle, Twinkle, Little Star in Antelope. Trey teased Fire (Ohio Players) in La Grange. This show is available as an archival release on LivePhish.com.</p>\r\n",
