    "shownotes": "Trey sang the verses of Fee through a megaphone. Glide included Simpsons, All Fall Down, and Random Note signals. The ending of Tela and the beginning of My Friend featured Trey on acoustic guitar. Nellie Kane was teased in Divided Sky and also in YEM from Mike. YEM&#39;s jam segment included Trey quoting &quot;Here comes Speed Racer&quot; and teases of Smoke on the Water and the vocal jam contained verses from Psycho Killer. Contact subsequently started as part of the vocal jam. Memories was performed without microphones. Crimes of the Mind (with the Dude of Life on vocals) was played for the first time since November 8, 1991 (234 shows).",
