    "shownotes": "<p>Reba contained a DEG tease from Trey and Chalk Dust contained Fire (Ohio Players) and Can&#39;t You Hear Me Knocking teases. Guelah contained Key Change and Random Note signals. Melt contained Nellie Kane teases from Mike and was briefly teased prior to The Horse, which featured Trey on acoustic guitar. Page teased Lean on Me in Squirming Coil. Tweezer included three Get Back signals, Key Change and I Let A Song Go Out of My Heart signals, and a Simpsons signal after the second Landlady. The second Landlady contained a Get Back signal prior to returning to Tweezer. Maze contained Mystery Achievement teases from Mike and Trey.&nbsp;Possum included a Tweezer Reprise tease.</p>\r\n",
