    "shownotes": "<p>Trey teased the W&uuml;rm portion from Starship Trooper&nbsp;on acoustic guitar after Stash. Ginseng featured Trey on acoustic guitar and Fish on Madonna washboard. Fluffhead started with Trey on acoustic guitar. Bowie included jams based on The Mango Song and Magilla, My Favorite Things and Fire (Ohio Players) teases, and a Tritone Down signal. Bathtub Gin included Tequila, Rift, Weekapaug, and China Grove teases as well as a Little Drummer Boy quote from Mike. Mike&rsquo;s Song included Ya Mar quotes from Mike and a Stranglehold quote, while Suzy included a Sweet Home Alabama tease. Amazing Grace was performed without microphones.&nbsp;This show is available as an archival release on LivePhish.com.</p>\r\n",
