    "shownotes": "<p>Trey teased Fire (Ohio Players) in Chalk Dust and La Grange. The Horse featured Trey on acoustic guitar. It&#39;s Ice contained a Dance of the Sugar Plum Fairy tease from Page and Melt contained Miss You and&nbsp;Linus and Lucy teases from Mike. 2001 included a Mona Lisa tease from Mike.&nbsp;Antelope included a Dixie tease; the &ldquo;Rye, Rye Rocco&rdquo; lyrics were sung over the Have Mercy melody before the band kicked back into the Antelope ending. During Daniel Saw the Stone, Trey updated the crowd on the score of a pre-season football game. YEM contained brief jams based on the theme from <em>Speed Racer</em>, Smoke on the Water, and quoting of Mystery Achievement (Pretenders). On Broadway was briefly quoted during the YEM vocal jam. This show was officially released as <em>Live Phish 07</em>.</p>\r\n",
