    "shownotes": "<p>Mike dropped a few vocal references to Wilson in Llama. Divided Sky contained Call to the Post teases. Guelah Papyrus included an Oom Pa Pa signal. The Horse featured Trey on acoustic guitar and began with a Bowie tease. Trey teased the <em>Speed Racer</em> theme and Frankenstein&nbsp;in YEM. The vocal jam in YEM was based on Ob-La-Di, Ob-La-Da. Memories was performed without microphones.&nbsp;This show is available as an archival release on LivePhish.com.</p>\r\n",
