    "venue": "Red Rocks Amphitheatre",
    "shownotes": "<p>The band began the show with an appropriate opener, as the storm that had lingered in the Morrison sky cleared just before the show began. The Harpua story told the history of Red Rocks and the fate of a giant iguana, who was referred to throughout the show. Harpua also included a Rock and Roll Part Two tease and a tease of Eye of the Tiger by Page during Trey&#39;s narration about Poster looking directly into the eyes of the iguana. Trey teased Nellie Kane in Maze. Ginseng was acoustic, was dedicated to Brad Sands, and was preceded by a &quot;Charge!&quot; tease from Page. Antelope included a Simpsons signal and a Can&rsquo;t You Hear Me Knocking jam. Trey teased So What in Slave. The beginning of My Friend featured Trey on acoustic guitar. Purple Rain featured Mimi Fishman joining Fish on vacuum.</p>\r\n",
