    "shownotes": "<p>This show marked the first Mind Left Body Jam since April&nbsp;18, 1992&nbsp;(193&nbsp;shows), I Didn&rsquo;t Know featured Fish&nbsp;on washboard. Possum contained Fire (Ohio Players teases from Trey and a Blue Monk teases from Page. Trey sang the verses of Fee through a megaphone. Fee through Daniel Saw the Stone featured The Flecktones (B&eacute;la Fleck on electric banjo, Victor Wooten on bass, and Roy &ldquo;Future Man&rdquo; Wooten on drumitar) and Nellie Kane featured B&eacute;la Fleck. Guelah included Oom Pa Pa and Random Note signals, and Bowie included a Simpsons signal. Amazing Grace was performed without microphones. Page and Trey teased Blue Monk in Nellie Kane.&nbsp;B&eacute;la Fleck and the Flecktones were the opening act.</p>\r\n",
