    "shownotes": "<p>Trey teased Fire (Ohio Players) in Stash and Tweezer. Ginseng Sullivan featured Trey on acoustic guitar, Mike on upright bass, Page on piano, and Fish on Madonna washboard and was preceded by a Roundabout tease. Antelope featured Tom Marshall on vocals. Tweezer contained an I Feel the Earth Move tease from Page and The Tra La La Song (One Banana, Two Banana) and&nbsp;Jean Pierre teases from Trey. It&#39;s Ice contained a Random Note signal. Peaches en Regalia was teased in It&rsquo;s Ice, Possum, Suzy Greenberg, at the end of the second HYHU (by Trey on drums), and Golgi Apparatus. Trey sang the verses of Fee through a megaphone.&nbsp;Possum&nbsp;contained an Earache My Eye tease. The band put on wet suits during the end of the YEM vocal jam, which contained a HYHU tease. The third set was preceded by bubble noises through the PA and the band &ldquo;diving&rdquo; into the aquarium on stage. Auld Lang Syne was teased in the DWD Jam and Hood. Suzy also contained a Smoke on the Water tease and Hood also contained a brief <em>Odd Couple</em> theme tease from Page. The entire show was broadcast live (and rebroadcast the following day) on Boston&#39;s WBCN 104.1 FM.</p>\r\n",
