    "shownotes": "As the trampolines were brought out for YEM, Trey announced that his understudy (Brad Sands) would stand in for him in the tramps routine. Brad took Trey&rsquo;s place on the tramps; Trey sat in a chair during that segment of YEM, reading a newspaper. YEM also included Trey trading teases of Sunshine of Your Love with Page, who alternated with Sunshine of My Life teases. The YEM vocal jam was based on My Soul. Possum subsequently contained teases of Sunshine of Your Love. Amazing Grace was performed without microphones.",
