    "shownotes": "<p>Stash closed with a Can&rsquo;t You Hear Me Knocking tease. Ginseng was performed acoustic, without microphones, and featured Fish&nbsp;on washboard. Faht featured Fish&nbsp;on acoustic guitar. Trey sang the verses of Fee through a megaphone. Reba contained an All Fall Down signal in the pause before the whistling ending and Bowie contained Oom Pa Pa and Simpsons signals in the intro and &#39;A&#39; Train and Reba teases from Trey. Trey tesaed Dixie in &#39;A&#39; Train.&nbsp;Sweet Adeline was also performed without microphones.</p>\r\n",
