    "venue": "Glens Falls Civic Center",
    "shownotes": "Harpua included the Vibrations of Life and Death. Jimmy decided to put on his favorite album <em>Barney&#39;s Greatest Hits, </em>but turned his turntable on the wrong way and started playing it backwards. Fish&nbsp;then proceeded to sing a verse of War Pigs. Trey subsequently quoted I Love You (a.k.a. the theme to <em>Barney &amp; Friends</em>) before Harpua resumed. Poster was swallowed up into the earth by the Vibration of Death. &quot;The Vibration of Death is gone&quot; replaced the usual &quot;The storm is gone.&quot; Prior to the Vibration of Life, Wilson was teased and quoted. A Pink Floyd <em>Dark Side of the Moon</em> tease (the heartbeats from Speak to Me) was pumped through the P.A. at the beginning of the second set. The second set &quot;musical costume&quot; was The Beatles&#39; <em>The Beatles </em>(also known as <em>The White Album</em>) and was selected via fan vote<em>. </em>All of the <em>White Album</em> songs, other than Piggies, were Phish debuts, although Ob La Di, Ob La Da had been jammed or teased on many occasions. Glass Onion&#39;s lyrics were changed to &quot;I told you &#39;bout Guyute the pig.&quot;&nbsp;Piggies was played for the first time since November 14, 1985&nbsp;(875&nbsp;shows). HYHU was teased prior to Why Don&#39;t We Do It in the Road. Birthday wasn&rsquo;t sung; Page and Mike noodled a bit while Fish&nbsp;presented a birthday cake to Brad Sands, who accepted it while wearing a Jon Fishman dress. Helter Skelter ended with the band singing &quot;I&#39;ve got blisters on my fingers&quot; <em>a cappella</em> to the tune of Back In My Hometown. Honey Pie&#39;s lyrics were changed to reference &quot;Cactus.&quot; Cry Baby Cry ended with Fish&nbsp;on vacuum with Revolution 9 segueing out of the vacuum solo. The background tape playing along with Revolution 9 was Mike&rsquo;s composition He Ent to the Bog from Phish&rsquo;s <em>White Tape</em>. The song ended with Fish&nbsp;stark naked and running around while the band blew bubbles and waved. Good Night was taped from the album and closed the second set. The third set began with a Custard Pie tease from Trey and an Overture tease from Page, while Bowie contained a <em>Gilligan&#39;s Island</em> theme tease from Mike and Antelope&#39;s intro contained a Stash tease from Trey. The Costume Contest contained a &quot;Charge!&quot; tease from Page. This show was officially released as <em>Live Phish 13</em>. The soundcheck&#39;s Jam was released as an iTunes bonus track called &quot;Glen Falls Soundcheck Jam&quot; and contained a Frankenstein tease from Mike and a May The Force Be With You (The Force Theme from <em>Star Wars</em>) tease from Trey. The Poor Heart and Dog Log in the soundcheck were slow versions.",
