    "shownotes": "Trey played along to Gary Glitter&rsquo;s Rock and Roll Part 2, which was being played over the P.A., at the start of the first set. Antelope featured guest vocals from Tom Marshall. Divided Sky contained a brief Auld Lang Syne tease from Trey. Mike&rsquo;s Song included a Shine tease and Weekapaug contained a Can&#39;t You Hear Me Knocking tease as well as an Auld Lang Syne tease from Trey. Slave contained Crimes of the Mind teases. Before the lights went out for the third set, the audience &ldquo;overheard&rdquo; the band before the set. Fish wound up saying &ldquo;I want a jumbo hot dog, large fries and shake&rdquo; delivered on stage. The band came out, started up My Sweet One, and was interrupted by an announcer asking who ordered the food. The band pointed at Fish, who looked confused as huge props of a hot dog, fries and shakes descended from the ceiling next to the drum set. The band played 2001 while the hot dog landed. The James Bond Theme was then broadcast over the PA while technicians (wearing &ldquo;Rocket Scientist&rdquo; jackets) prepared the hot dog, and the band climbed in with their instruments and flew out over the audience, as balloons popped and feathers, confetti and &ldquo;Phish NYE 1994&rdquo; ping pong balls fell from the ceiling. Various music, including the Captain Beefheart song Tropical Hot Dog Night, was played over the P.A. as the hot dog space ship flew back and forth. Mike&#39;s maternal grandmother, Lillian Cherry, joined the band on stage for Chalk Dust with a shoe in her hand.&nbsp;This version of Bouncing appears on <em>A Live One</em>.",
