    "shownotes": "<p>Trey teased Dave&#39;s Energy Guide in DWD. The Mockingbird narration included a reference to Talking Heads&rsquo; David Byrne, who appeared in the mountain as the face of Icculus. As Trey told the story, Byrne threw Colonel Forbin off the mountain and into the arms of the &ldquo;evil&rdquo; Famous Mockingbird. The second set &quot;musical costume&quot; was Talking Heads&#39; <em>Remain in Light. </em>All of the <em>Remain in Light</em> songs were Phish debuts; the set featured Karl Perazzo on percussion, Dave Grippo on saxophone, and Gary Gazaway on trumpet (except for Born Under Punches, which featured Gazaway on valve trombone). Perazzo also played during the entire third set. Jesus Just Left Chicago, Suzy Greenberg, and Frankenstein also featured Grippo and Gazaway. At the end of Houses in Motion (which featured Trey teasing Tweezer), an armchair was brought out to the center of the stage and Mike sat in it to sing Seen and Not Seen. While he sang, Karl Perazzo drummed and Trey played bass. After Overload (which featured Fish singing in front of the band and not on drums), a bizarre on-stage demonstration (including Fish on vacuum) closed the set. The third set opened with a Feel Like a Stranger tease. Suzy included a Born Under Punches tease from Page. Simple included a tease of Mama Told Me Not to Come. The soundcheck&#39;s Overload was performed with horns and briefly featured Fish&nbsp;on vacuum. This show was officially released as <em>Live Phish 15</em>.</p>\r\n",
