    "location": "Limestone, ME, USA",
    "venue": "Loring Commerce Centre",
    "shownotes": "This was the first show of The Great Went festival. Harpua picked up where the Clifford Ball Harpua left off. After Chalk Dust, Trey remarked that the first three songs served as the soundcheck, which the band did not do before the show. The jam out of Simple, the beginning of My Soul, and the jam before Slave included <em>Odd Couple</em> theme teases. The jam before Slave also contained an Entrance of the Gladiators tease.&nbsp;Halley&rsquo;s Comet included On Your Way Down teases. The lyrics in Cities were changed to&nbsp;reference Fishman sleeping in the daytime.&nbsp;The Julius intro was partially performed <em>a cappella</em> with finger snaps. Funky Bitch featured a fireworks display behind the stage that culminated as the song ended. After the show, the members of Phish DJ&rsquo;d under pseudonyms at a festival tent in what has become known as the &ldquo;Disco Set.&rdquo;",
