    "location": "Limestone, ME, USA",
    "venue": "Loring Commerce Centre",
    "shownotes": "This was the second show of The Great Went festival. Tweezer featured a Cities-like jam and Simple teases, and the Digital Delay Loop Jam included London Bridge is Falling Down teases. Disease was unfinished. Bathtub Gin contained a Proud Mary tease from Page. Throughout the weekend, fans painted pieces of wood that were assembled into an Art Tower. During Disease, Page and Fish&nbsp;painted their portions of the Art Tower; Mike and Trey painted theirs during 2001. The Art Jam saw the crowd carry the pieces of the band&rsquo;s art to the side of the venue where it was hoisted onto the Art Tower and added to the fans&#39; art. During Tweezer Reprise, the Art Tower was burned to the ground as The Great Went came to a close. As the Hood jam kicked in, Trey asked Chris to turn the lights off and the band jammed while the front section of the audience engaged in the first Hood glowstick war. Trey remarked to the crowd at the end of the jam that the visual display was cool. Between the first and second sets, the Bangor Symphony Orchestra performed selections from Stravinsky and Debussy as a red-smoke-spewing glider synchronized its swoops and dives to the music. Buffalo Bill was played for the first time since December 31, 1994 (204 shows).",
