    "shownotes": "The Maze jam was halted while Trey humorously thanked the crowd. Golgi ended with Hip Hop Hooray quotes by Trey. The last line in Makisupa changed to &quot;came to Vermont.&quot; Trey called Page &quot;Petroff&quot; before he took a piano solo. Trey let Fish&nbsp;take a drum solo, but told the crowd to whistle if he (Fish) went on too long.&nbsp; Trey added that they had a &quot;band rule&quot; that they all begin whistling if Fish, who likes to ramble when he talks, ever talks for longer than two minutes. Fish took a boring &quot;drum solo,&quot; which drew whistles from the crowd. Piper contained a Lady (Little River Band) tease from Page and Trey and Possum contained a Stash tease from Trey. This show is available as an archival release on LivePhish.com.",
