    "shownotes": "<p>This single set performance was part of the annual Farm Aid benefit concert which also included Hootie and the Blowfish, The Del McCoury Band, Brian Wilson, Wilco, Martina McBride, Willie Nelson, John Mellencamp, and Neil Young. The set featured the Phish debuts of Arc, Down By the River, Moonlight in Vermont, Will the Circle Be Unbroken, and Uncloudy Day (although Will the Circle Be Unbroken was also played during the November 19, 1994 &ldquo;Parking Lot Jam&rdquo;). Trey teased Old MacDonald Had a Farm and Dave&#39;s Energy Guide in Runaway Jim. Neil Young sat in from Runaway Jim through the end of the set; Willie Nelson and Paul Shaffer sat in during Moonlight in Vermont through Uncloudy Day. Four Native American dancers came onstage before Will the Circle Be Unbroken. Circle featured Willie Nelson on vocals. Amazing Grace was performed for the first time since December 31, 1996 (115 shows) and included instrumental accompaniment. Trey teased 2001 in Uncloudy Day. This set was broadcast live on Country Music Television, though the beginning of Runaway Jim was cut from the broadcast.</p>\r\n",
