    "venue": "The Fillmore",
    "shownotes": "This &ldquo;under the radar&rdquo; show was never formally announced by Phish. San Francisco radio station KFOG leaked word of an upcoming &ldquo;surprise announcement&rdquo; two weeks before the show, telling Phish fans to tune in on Saturday morning for details. The 11:00 a.m. announcement was that tickets would be sold at noon the vacant Pier 32, prompting a mad rush of fans to the waterfront. Of the several thousand who arrived, roughly four hundred lucky people were able to buy vouchers entitling them to a pair of tickets. Prior to Brian and Robert, Trey said that Fish used to hate the yellow light and that Fish used to have a list of things that he hated, adding that every time they found out something Fish hated, they&#39;d always do it (prompting Page to tease HYHU, which Fish also hates). Fish added that he hated the vowel &quot;ooo&quot; (the crowd responded with &quot;ooo&quot; noises). Trey said the only way to overcome something you hate was to face it head on. Trey then had Chris Kuroda shine a yellow light on Fish for Brian and Robert.&nbsp;Reba did not have the whistling ending. Hood contained a tease of Aaron Copland&rsquo;s Fanfare for the Common Man. After the show, some fans were given a poster (later for sale from Phish Dry Goods) and a bumper sticker (saying: &ldquo;We&rsquo;ve just come from Phish at the Fillmore. It was nice.&rdquo;).",
