    "shownotes": "Moma included Manteca teases. Coil included Piper teases and featured an atypical jam that segued into Slave. The debut of Grind featured Tom Marshall on vocals and was dedicated to Phish fan Chris Heinel, who had recently been injured in a lacrosse accident. Possum included Wipe Out teases. For this show, the Holiday Run dancers were dressed as nymphs.",
