    "billed_as": "Phish",
    "link": "https://phish.net/setlists/phish-december-30-1999-big-cypress-seminole-indian-reservation-big-cypress-fl-usa.html",
    "location": "Big Cypress, FL, USA",
    "venue": "Big Cypress",
    "shownotes": "This was the first show of the Big Cypress festival. Light Up was played for the first time since March 1, 1989 (1,092&nbsp;shows), included Jibboo teases from Mike, and was unfinished. Corinna was subsequently played for the first time since February 18, 1989 (1,096&nbsp;shows). Che Hun Ta Mo and Big Alligator (both Phish debuts) featured guests John McEuen on mandolin, Raiford Starke on guitar, and Seminole Indian Chief Jim Billie on guitar and lead vocals. Mike&rsquo;s Song included an Immigrant Song tease and Weekapaug included a Light Up tease and an Auld Lang Syne tease at midnight.",
    "phishnet_venueid": 443,
