    "shownotes": "Frankie Says was unfinished and included an extended jam segment. Fish&nbsp;forgot the words to Love You and scatted one verse, then sang, in near-perfect time: &ldquo;I can&rsquo;t remember the words now / I can&rsquo;t remember the words / And it really doesn&rsquo;t matter &lsquo;cause I can&rsquo;t sing either / So who gives a fuck, it&rsquo;s time for the vacuum cleaner.&rdquo; During the closing HYHU, Fish&nbsp;introduced the band, and himself as &ldquo;Henrietta.&rdquo; Suzy included an extended jam segment after the first chorus. Trey seemed to end the song after the second chorus while the rest of the band continued to play. The jam after Suzy contained a Lizards tease from Trey.",
