    "location": "Las Vegas, NV, USA",
    "venue": "Thomas & Mack Center",
    "shownotes": "Dave Matthews Band lighting director Fenton Williams manned the board at all three dates on this Vegas run. This show marked Chris Kuroda&rsquo;s first absence from the light crew since April 2, 1989 (1,179&nbsp;shows). Disease was unfinished. Jennifer Hartswick assisted on vocals during Girls, a Jay-Z cover that made its Phish debut. Secret Smile featured a new arrangement.&nbsp; This was the first Sneakin&#39; Sally to contain a vocal jam since May 28, 1989 (1,150&nbsp;shows). The vocal jam led into a brief quote of Coconut.&nbsp; Trey then asked Fish&nbsp;if he was wearing his &ldquo;new suit,&rdquo; referring to his&nbsp;sonic dress. After Fish&nbsp;answered &ldquo;no,&rdquo; Trey went on to rap about how people would have to attend the following night to see Fish&nbsp;play it. The rap slid into a bit of free-form vocal jamming to close the show.",
