    "shownotes": "Fenton Williams sat in for Chris Kuroda on lights. Rock and Roll included Low Rider teases. Camel Walk contained Wilson and Theme from <em>Barney Miller</em> teases. Little Drummer Boy appeared for the first time since December 2, 1999 (114 shows). Love You had Fish&nbsp;&ldquo;playing&rdquo; his new sonic dress, a garment woven from cassette tape that produced noise when touched with special gloves akin to tape heads.",
