    "location": "Las Vegas, NV, USA",
    "venue": "Thomas & Mack Center",
    "shownotes": "Fenton Williams sat in for Chris Kuroda on lights. The band played Meatstick seemingly at the instigation of a crowd chant of the lyrics that began behind the stage.&nbsp;Caspian included a DEG tease from Trey.&nbsp;YEM included a lengthy Meatstick session immediately following the trampolines segment. As Fish&nbsp;took a drum solo, Trey set his guitar down to perform the Meatstick Dance while the crowd chanted the lyrics. The band jammed back into YEM, but then left Page to solo while again Trey danced and the crowd sang. This cycle repeated with Mike soloing on bass. YEM lacked its standard vocal jam. Trey rapped: &ldquo;time for the Meatstick&rdquo; over the intro to Tweezer Reprise, which also had its normal lyrics replaced with &ldquo;won&rsquo;t you step into the Meatstick?&rdquo; Wolfman&rsquo;s contained teases of Simple, Jean Pierre, Sneakin&rsquo; Sally, and Possum.",
