    "shownotes": "This was the first show of the Coventry festival and was simulcast in movie theaters nationwide. During YEM, the band gave away their trampolines. Throughout the duration of the set, groups of fans held the trampolines above their heads, and some&nbsp;fans jumped on the trampolines as well. Tom Marshall sang the lyrics to Antelope. Trey teased Waves in Halley&#39;s Comet. Before Bowie, Trey told a story of the summer he spent living in a cabin in the Northeast Kingdom where he remembered writing several songs, including Bowie. Trey explained that Bowie was an attempt to see &ldquo;how far can you push it in the harmonic and rhythmic language and still have people dancing.&rdquo; During Hood, Trey (speaking in rhythm) noted that because there were a row of rocks separating the band from the crowd, they were feeling a certain level of disconnect (particularly&nbsp;when Mike plays a &quot;sexy&quot; note). To remedy the situation, Trey and Mike ventured down onto the rocks for the duration of the song. At the end of Hood, the band stopped playing, allowing the audience to sing the &ldquo;You can feel good, good, good about Hood&rdquo; refrain.",
