    "location": "Coventry, VT, USA",
    "venue": "Newport State Airport",
    "shownotes": "This was the second show of the Coventry festival and was the presumed &ldquo;Final Show.&rdquo;&nbsp;When Trey made his &ldquo;break-up&rdquo; announcement the preceding May, he indicated that Coventry would be the final Phish shows. In reality, this turned out to be the final public show for over four and a half years. This show was simulcast in movie theaters nationwide. Before Anything But Me, Trey announced that, for the first time in 21 years, he was nervous performing a Phish show. During Wolfman&rsquo;s, Trey revealed that the Wolfman&rsquo;s Brother is, in fact, Fish (as well as the fact that he handed the phone to his friend Liz Durfee). Also, during Wolfman&rsquo;s, Trey and Mike invited their mothers onstage (and later John Paluska) to do the &ldquo;sexy bump&rdquo; dance. Disease was unfinished and featured Trey briefly playing his guitar with a glow stick. Both Page and Trey broke down during an especially emotional Velvet Sea. After a thoroughly botched Glide, all four band members offered words of thanks to the fans for their continued support and dedication and brief reflections on their twenty years together. Trey then stated that what they really needed to do was &ldquo;blow off some fucking steam&rdquo; before starting up Melt. There was an enormous glow stick war during Ghost featuring hundreds, if not thousands, of orange glow sticks. This version of Seven Below saw all of the band members sporadically shouting &ldquo;Seven Below&rdquo; throughout the jam. The Phish debut of Cool Jerk contained alternate lyrics honoring monitor mixer, Mark &ldquo;Bruno&rdquo; Bradley. The Dickie Scotland Song was spontaneously created and included lyrics in honor of production manager, Hadden Hipsley, and tour accountant, Richard Glasgow (a.k.a. Dickie Scotland). Before Wilson, Trey asked the crowd to sing to another of their friends &ldquo;for the last time.&rdquo; There was a fireworks display between the end of the third set and the encore. Before the encore, while explaining the origins of The Curtain, Trey jokingly announced that the entire Chicago Symphony and the Twyla Tharp Dance Troupe were going to perform Gamehendge. Trey explained that they chose The Curtain With as the last song to bring them full circle, because, not only was it one of the first Phish songs he wrote, but he wrote it in a cabin one town over from Coventry. Trey stopped and restarted the jam segment of the Curtain With, because they were in the wrong key or, as he explained, &rdquo;Since we are going to be bringing ourselves back in time, we may as well do it in the correct key.&rdquo; There was no P.A. music after the Curtain With.",
