    "shownotes": "After Gin, Trey wished Happy Birthday to an audience member holding a sign for The Sloth, saying they would get to it eventually (they played it two nights later). Trey then wished his wife, Sue, a happy fifteenth wedding anniversary. Trey also said some words in remembrance of Les Paul, who passed away earlier that day. Trey said that Les was a hero to all of the band members for, among other reasons, continuing playing music into his nineties and that hopefully they would be playing into their nineties too. Finally, Trey dedicated the ensuing version of How High the Moon (last played on March 8, 1993 (710 shows)), to the memory of Les.&nbsp; Trey changed the lyrics of Antelope to &ldquo;Been you to have any splash cymbal solo, man?&rdquo;, after which Fish took a splash cymbal solo.",
