    "shownotes": "This show featured the first versions of Forbin&rsquo;s and Mockingbird since September 30, 2000 (96 shows), which were performed without narration. During I Didn&rsquo;t Know, Trey introduced Fish as &ldquo;Recent Julliard Master&rsquo;s Vacuum Program graduate, the one and only, Jon Moses Quagmire DeWitt Hampton.&rdquo; DWD contained a Reba jam and was unfinished. Piper included a Spill the Wine tease from Page. This show featured the first Psycho Killer since December 7, 1997 (282 shows). Psycho Killer was unfinished and disintegrated into a self-described, electronic &ldquo;Pong&rdquo; jam. During the post-Psycho Killer &ldquo;Pong&rdquo; jam, Trey initiated a dance contest saying that whoever could best dance to that music would &ldquo;win something.&rdquo;&nbsp; After Catapult (while continuing the &ldquo;Pong&rdquo; jam), Trey asked, &ldquo;Does everybody else love this song as much as I do?&rdquo; and said that he was &ldquo;waiting for the day when they play stuff like this on the radio.&rdquo;&nbsp; Icculus was last performed on July 18, 1999 (193 shows). The Icculus narration centered on the fact that &ldquo;you crazy kids&rdquo; just don&rsquo;t read anymore.&nbsp; The &ldquo;Pong&rdquo; jam reappeared during the YEM jam. The soundcheck included a jam with lyrics that were made up on the fly with Trey on bass (so that Mike could check on bass sounds from the audience) and Fish on drums. Trey briefly quoted Spill the Wine and The Pendulum during the soundcheck jam.",
