    "venue": "Empire Polo Club",
    "shownotes": "There were two soundchecks for Festival 8: an acoustic afternoon&nbsp;session, followed several hours later by a separate electric&nbsp;soundcheck that evening. The electric soundcheck was broadcast on&nbsp;Phish's on-site festival radio, JACK-FM 95.9 \"The Bunny\" as well as Sirus/XM&nbsp;Radio. The acoustic soundcheck was not broadcast and the song order&nbsp;may be incorrect.&nbsp;The short Devil With a Blue Dress On Jam included the chorus and part of a verse sung by Trey, as well as a Good Golly Miss Molly quote. The Starship Trooper Jam consisted of part of the W&uuml;rm segment of the song. Before Liquid Time, Trey quoted Fuck Your Face and briefly teased Kids (MGMT); the jam out of Liquid Time dissolved into a vocal jam featuring the band members snoring and featured a Lengthwise quote from Trey.&nbsp;",
