    "link": "https://phish.net/setlists/phish-october-30-2009-empire-polo-club-indio-ca-usa.html",
    "location": "Indio, CA, USA",
    "venue": "Empire Polo Club",
    "shownotes": "This show was part of the three-show <a href=\"http://www.phish.com/festival8\">Festival 8</a>. Stash contained an L.A. Woman tease. During I Didn&#39;t Know, Trey announced that&nbsp;<a href=\"http://phish.net/faq/henrietta.html\">Henrietta</a> would, for the first time in human history, <a href=\"http://phish.net/faq/origin-a-baby-blue-electrolux-vacuum-cleaner-aka-the-va\">suck and blow</a> at the same time, in the shape of a figure 8. Disease was&nbsp;unfinished. During Bowie, Trey said, &quot;I&#39;m gonna give you a little hint about the Halloween album now.&quot;",
