    "location": "Miami, FL, USA",
    "venue": "American Airlines Arena",
    "shownotes": "AC/DC Bag and Ghost contained Auld Lang Syne teases. Swept Away and Steep were played for the first time since July 1, 2000 (145 shows). Demand was played for the first time since November 14, 1996 (392 shows). NO2 was played for the first time since July 13, 1999 (219 shows). Prior to the third set, a pedestal stating 2010 was placed on the front of the stage and a covered structure was placed behind Fish&#39;s drumset. During DWD, as the clock turned midnight, hundreds of balloons were released upon the crowd, fireworks went off on each side of the stage, and a disco ball was lowered onto the pedestal. After DWD, Trey opened the ball and Fish&nbsp;climbed inside. Trey and Mike, with some help from stagehands, proceeded to put the ball in a giant cannon aimed towards a giant net hanging from the rafters with an illuminated &ldquo;X&rdquo; on it. Page hit the trigger and purportedly &quot;blasted&quot; the ball through, not only the net, but also the roof of the arena. A searchlight appeared to come through the roof and was accompanied by helicopter sounds. With Fish&nbsp;apparently shot out of the venue, Trey asked if anybody knew how to play the drums and ended up finding Sarah, a girl from Pittsburgh. Trey asked how long she had played the drums and what her favorite song was and she responded with six months and Fluffhead respectively. Sarah was surreptitiously replaced by Fish, now wearing a dress identical to Sarah&#39;s and a black wig, who played the entire third set and encore, but Sarah came out at the end of the third set and bowed with the band instead of him. Blue Moon was a Phish debut and was performed as an instrumental while Trey thanked the entire crew. After the show, the disco ball was revealed to have &quot;crashed&quot; into a white car that had been parked in front of the American Airlines Arena with a sign on the windshield stating &quot;This car was driven down from Vermont&quot; and &quot;fueled by maple syrup.&quot; &nbsp;After being &ldquo;struck&rdquo; by the &ldquo;human cannonball,&rdquo; the car was emitting smoke and leaking maple syrup and the entire area was cordoned off with police tape.&nbsp;",
