    "shownotes": "Whole Lotta Love was incomplete (one verse only) and was played for the first time since March 1, 1991 (1,033 shows). Wolfman&#39;s contained a vocal jam. Ha Ha Ha, Gin, Possum, Tweezer, and Tweezer Reprise all contained Whole Lotta Love teases and the Bowie intro contained a Whole Lotta Love quote from Trey. Squirming Coil contained The Rain Song and Thank You teases from Page and Possum also contained a Sneakin&#39; Sally tease. The incomplete versions of Heartbreaker, Thank You, and Stairway to Heaven were all Phish debuts. Ramble On was played for the first time since August 12, 1998 (305 shows). After Stairway to Heaven, Trey joked, &quot;Happy Halloween! See you all next year.&quot; Mike teased The Lemon Song before Halley&#39;s. Appropriately, Whole Lotta Love was also the post-show music. From the soundcheck, Ramble On and the second and third versions of Whole Lotta Love were incomplete. Destiny Unbound was played by only Mike and Fish, started out as being sung to the drumbeat of Time Loves A Hero and included a Live and Let Die quote from Mike.",
