    "venue": "Boardwalk Hall",
    "shownotes": "Page performed Frankenstein on keytar. Ghost included a San-Ho-Zay tease from Trey. Spooky was performed for the first time since April 14, 1993 (751 shows). The second set &quot;musical costume&quot; was Little Feat&#39;s&nbsp;<em>Waiting for Columbus</em>. Join the Band (the first track of&nbsp;<em>Waiting for Columbus</em>)<em>&nbsp;</em>was played over the P.A. before the start of the second set. &nbsp;Subsequently, Phish was introduced as &quot;Little Feat&quot; before Fat Man in the Bathtub. In the tradition of some of Phish&#39;s previous crowd experiments in the early &#39;90s, flyers explaining a new Secret Language prank were included in the Phishbills that were passed out to fans as they walked into the show. The prank, designed to confuse those who would later listen to the recording, consisted of an announcer introducing Phish (as Little Feat). When the announcer would say a letter of the band FEAT (&quot;Give me an F!&quot;), the crowd would respond with letters corresponding to PHISH (&quot;P-H!&quot;). All of the songs in the second set other than Time Loves a Hero were Phish debuts. All of the songs in the second set, other than Don&#39;t Bogart That Joint and Willin&#39;, featured Giovanni Hidalgo on percussion. A five piece horn section consisting of Aaron Johnson, Stuart Bogie, Ian Hendrickson-Smith, Michael Leonhart and Eric Biondo joined the band for Old Folks Boogie, Time Loves a Hero, Day or Night, Mercenary Territory, Spanish Moon, Dixie Chicken, Rocket in My Pocket and Feats Don&#39;t Fail Me Now. Willin&#39; featured Page on bass, Mike on piano, Trey on drums and Fish on vocals. Prior to the piano solo at the beginning of Willin&#39;, Fish remarked, &quot;That&#39;s supposed to be Bill Payne on the keyboard.&quot; Don&#39;t Bogart That Joint was performed <em>a cappella</em>. Trey introduced the guest musicians at the start of Feats Don&#39;t Fail Me Now and Page teased &quot;Charge!&quot; during the introductions. At the conclusion of the second set, the entire band marched the perimeter of the floor. Disease was unfinished, was initially botched, and had to be restarted, prompting Fish to declare, &quot;This one&#39;s off <em>our </em>album.&quot; Julius featured Giovanni Hidalgo and the <em>Waiting for Columbus</em>&nbsp;horn section.",
