    "location": "Princeton, NJ, USA",
    "venue": "Richardson Auditorium, Princeton University",
    "shownotes": "<p>This performance featured Trey on acoustic guitar and grand piano, with the <a href=\"https://www.facebook.com/scorchioquartet\">Scorchio Quintet</a>: <a href=\"http://www.gregorkitzis.com/\">Gregor Kitzis</a> (violin),&nbsp;<a href=\"http://twitter.com/#!/maxmoonmist\">Maxim Moston</a> (violin),&nbsp;<a href=\"http://www.marthamooke.com/\">Martha Mooke</a> (viola),&nbsp;<a href=\"http://leahcoloff.com/\">Leah Coloff</a> (cello) and&nbsp;<a href=\"https://www.facebook.com/kris.saebo\">Kris Saebo</a> (bass). After &quot;Summer of &#39;89&quot; Trey related how he had so many memories from this room, and that the first time he was here was in April 1970, when his parents took him to an anti-<a href=\"http://en.wikipedia.org/wiki/Vietnam_War\">Vietnam War</a> rally, his first concert ever, at six-years-old, and the band was, ironically,&nbsp;<a href=\"http://en.wikipedia.org/wiki/Country_Joe_and_the_Fish\">Country Joe and the Fish</a>. Before &quot;Divided Sky&quot; Trey noted that &quot;one part of this song, the lyrics, were written in a field, right over there.&quot; Trey played grand paino on &quot;Bar 17,&quot; &quot;Gone&quot; and &quot;Wolfman&#39;s Brother.&quot; Leah Coloff added additional vocals on &quot;Flock of Words.&quot; After &quot;Flock of Words&quot; Trey acknowledged local resident and co-author Tom Marshall; he then noted that many of their songs had been written very close to the venue, including &quot;<a href=\"http://phish.net/song/glide/history\">Glide</a>.&quot; Tom provided additional vocals on &quot;Strange Design.&quot; Trey introduced the person responisble for many of his orchestral arrangements, <a href=\"http://donhartmusic.net/\">Don Hart</a>. &quot;Julie&quot; was a debut. Free MP3s of this performance are available at <a href=\"http://livephish.com/music/0,589/Trey-Anastasio-and-the-Scorchio-Quartet-mp3-flac-download-Live-From-Princeton.html\">LivePhish.com</a>&nbsp;(excepting &quot;Love Is Freedom,&quot; &quot;Water in the Sky,&quot; &quot;Brian and Robert&quot; and &quot;Julie&quot;).&nbsp;</p>\r\n",
