    "shownotes": "Weekapaug contained a Nellie Kane tease from Trey. The Horse was quickly aborted with Trey saying instead of playing Horse, he started thinking about how stupid the ending to My Friend, My Friend was and it threw him off. Fish&nbsp;said that he thought the ending was the greatest ending in rock history, that he loved it, and it was his favorite ending. The ending of My Friend, My Friend was then quoted. Trey said Maze was his personal favorite, prompting quick teases of the end of Maze by himself and Page. Trey asked Page what his favorite song ending was and Page responded with Lawn Boy, which the band subsequently played.&nbsp;Possum contained Lawn Boy and Stash teases. Light contained a Manteca tease from Page and Crosseyed and Painless quotes. Sand and GTBT also contained Crosseyed and Painless quotes.",
