    "shownotes": "For the fourth Father&#39;s Day in a row, Brother was performed and featured all of the band&#39;s children on stage and subsequent introductions (which included a &quot;Charge!&quot; tease from Page). After Timber, Trey sang the ending notes to Brother. Trey then said he had a trivia question for the crowd and asked &quot;how many songs end like this?&quot; and the band sang the ending of Brother again. He answered the question by saying the songs were My Friend, My Friend, Rift, and Brother (all of which had their endings &quot;sung&quot;). Trey added that tonight was special because from now on, Timber would also end with the Brother ending (which was sung again). Trey said Page could also end Lawn Boy that way from now on, prompting a Lawn Boy quote from Page. Mike then teased Ha Ha Ha. Trey went on to say that Metallica would be playing at Bader Field soon after Phish and that he didn&#39;t think they ended a single song like the ending of Brother (Trey sang the ending). Trey said if everyone wrote Metallica a note saying &quot;Dear Metallica, please end Master of Puppets like this&quot; (singing the ending one final time), if they got 20,000 notes, they just might do it. Fluffhead and Down With Disease subsequently had endings similar to Brother mixed in with their normal finishes. Reba did not contain the whistling ending.",
