    "shownotes": "Carl &quot;Geerz&quot; Gerhard sat in on trumpet for Party Time. Trey introduced Gerhard as having come to the School of Phish in 1991 and talked about Gerhard&#39;s teaching career in the Armed Services. Trey acknowledged the crowd&#39;s request by playing Tube. During I Didn&#39;t Know, Trey said that they took Fish&nbsp;on the road in 1983 and he went to the Phish School of Music, adding that he was now the executive officer of the &quot;Air Force.&quot; Trey said he didn&#39;t think Fish&nbsp;should be representing the vacuum cleaners without tucking in his shirt (a.k.a. his dress) and asked him to do so (Fish&nbsp;complied). Antelope included alternate lyrics &quot;Been you to tuck in your dress, man?&quot; &quot;Tuck, tuck, tuck, tuck&quot; and&nbsp;&quot;Tuck in your dress man, you&#39;re out of control!&quot; Trey also said that for 30 years, Fish has been leaving his dress untucked and told everybody to tuck in their dresses. Mike, Trey, and Page tucked in their shirts before the setbreak bow. Split Open and Melt included the alternate lyrics &quot;Split open and tuck.&quot; Backwards Down the Number Line contained a DEG tease from Trey. Lengthwise included an invitation for audience members to appear on stage and tuck (a few fans came on stage), contained alternate lyrics &quot;When you&#39;re there, I sleep tuckwise, and when you&#39;re tucked, I sleep, you really have to tuck&quot; and &quot;I sleep diagonal in my tuck,&quot; and Trey wielding a light saber, saying &quot;the force is weak with that one. And that one too. But the force is strong with that one.&quot; &nbsp;The audience was subsequently called out by Fish, Trey, and Page, in part being told repeatedly &quot;You suck at tucking&quot; over the Maze intro. The Maze intro also featured Trey asking Chris Kuroda to turn off the lights while he waved the light saber around, talked like Darth Vader, saying &quot;I am your father, Fish. I am your father,&quot; and played the guitar with his light saber. Fire contained more Tuck references, with Trey saying &quot;Tuck it!&quot; and the alternate lyrics &quot;Let the Tucker take over!&quot;&nbsp;Mike and Trey sported sombreros for Mexican Cousin.",
