    "venue": "MGM Grand",
    "shownotes": "The backdrop on the stage at&nbsp;the start of the show was a large gate adorned with a &quot;P.&quot; During Lawn Boy, Page introduced Mike as &quot;Michael Gordleone&quot; and Fish&nbsp;took a drum solo. Trey teased Saw It Again during Tube and San-Ho-Zay during Wolfman&#39;s. The musical costume was a set of original, mostly instrumental music played with the sound effects and narration of the 1964 Disneyland album <em>Chilling, Thrilling Sounds of the Haunted House</em>. Prior to the start of Set II, the stage was cleared of all band equipment, and a graveyard set was brought out. At the start of the set, smoke filled the stage, and zombies appeared behind the gate. When the gate opened, a large haunted house with the band inside was brought to the front of the stage. The sound effects and narration were played on the PA, while an undead narrator would emerge from a crypt inscribed with &quot;ESTHER&quot;&nbsp;prior to each song for&nbsp;the introduction. At the end of The Fuse, the sides of the house came down while sounds of an explosion were heard, and the band was revealed inside, dressed in white tuxedoes and with zombie face paint. Several zombies came to the front of the stage and danced during Martian Monster. At the conclusion of the set, the band members came down from the Haunted House riser, slowly walked to the front of the stage, and took bows, along with the entire cast of zombies. All songs during the second set were debuts, with the titles taken from the first ten tracks of <em>Chilling, Thrilling Sounds of the Haunted House</em>. Sand contained a tease by Trey&nbsp;of School&#39;s Out.&nbsp;Is This What You Wanted&nbsp;was a Phish debut. Page performed Frankenstein on keytar, which was played for the first time since July 1, 2012 (100 shows).",
