    "location": "New York, NY, USA",
    "venue": "Beacon Theatre",
    "shownotes": "<p>This performance was part&nbsp;of The Beacon Jams series and featured the debuts of I Never Left Home, A Wave of Hope, If I Could See The World,&nbsp;When the Words Go Away,&nbsp;and ...And Flew Away. Trey quoted Windora Bug after Soul Planet. Shade featured Jeff Tanski on piano. Stash was performed by Trey, Jeff on piano, and Cyro clapping. When the Words Go Away and Sunset Days were&nbsp;performed by Trey solo acoustic. The Inlaw Josie Wales was performed by just Trey on acoustic and Jeff Tanski on piano.</p>\r\n",
